          "comment": "Has rapidly developed into a leading miler this term; second in the Lockinge last time",
          "spotlight": "Seems versatile as regards ground; failed to score last term (still showed some good form) but has rapidly developed into a leading miler this season, travelling well and quickening smartly to win the Doncaster Mile (Listed) and bet365 Mile (Group 2) then going down by only a neck in the Lockinge; has very similar profile to last year's winner Charyn and remains of strong interest.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-05-17",
              "horse": "Dancing Gemini",
              "horse_id": "5146206",
              "race": "BoyleSports Lockinge Stakes (Group 1)",
              "race_id": "890438",
              "course": "Newbury",
              "course_id": "crs_936",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "Dancing Gemini has run a cracker but that ground was rattling fast. I asked the clerk of the course on Friday if he'd put a bit of water on it Friday but he wasn't playing ball.\"That's quicker ground than he's ever been on, but we've only gone down a neck. We don't duck and dive and will go to Ascot next. He went down on his sword and is a Group 1 winner waiting to happen - Roger Teal, trainer."
            },
            {
              "date": "2025-04-25",
              "horse": "Dancing Gemini",
              "horse_id": "5146206",
              "race": "bet365 Mile (Group 2)",
              "race_id": "891483",
              "course": "Sandown",
              "course_id": "crs_1404",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "We always thought Dancing Gemini could do what he has done today and that is why we were pitching him in all the Group races last year. Unfortunately, it was such a wet summer last year and we never got a chance. Everyone kept labelling him a soft ground horse but he's not a soft ground horse. I was delighted to see him win like that again today. I know some of the field will improve for today but Mr Fabre's horse was fit and he's no mug - he was third behind us in the French Guineas when we were runner-up. Haatem is also a serious horse. The Lockinge and the Prix d'Ispahan are the options now. We've got to get him a Group 1 and we'll do what is best for him so it's not decided yet. We'll see how the dust settles after today - Roger Teal, trainer."
            },
            {
              "date": "2025-03-29",
              "horse": "Dancing Gemini",
              "horse_id": "5146206",
              "race": "William Hill Doncaster Mile Stakes (Listed Race)",
              "race_id": "889286",
              "course": "Doncaster",
              "course_id": "crs_390",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "Dancing Gemini likes this track! I'm absolutely delighted. We've always had high hopes for this horse, doing what he did there in a quality field I'm very excited. We thought we'd start at a mile. He's bred for further and he's got that blistering turn of foot - sometimes if it's not broken don't fix it. We've got some talking to do now because there's the Group Two at Sandown he could go to but he could just go straight to Newbury - and it's local! - Roger Teal, trainer."
            },
            {
              "date": "2024-06-01",
              "horse": "Dancing Gemini",
              "horse_id": "5146206",
              "race": "Betfred Derby (Group 1) (British Champions Series) (No Geldings)",
              "race_id": "860280",
              "course": "Epsom",
              "course_id": "crs_442",
              "distance_f": "12",
              "distance_y": "2646",
              "quote": "Dancing Gemini ran well. I rode him to finish and he just emptied out. He'll be better back in trip - Dylan Browne McMonagle, rider."
            },
            {
              "date": "2024-05-12",
              "horse": "Dancing Gemini",
              "horse_id": "5146206",
              "race": "Emirates Poule d'Essai des Poulains (Group 1) (3yo Colts) (Grande Course) (Turf)",
              "race_id": "868323",
              "course": "Longchamp",
              "course_id": "crs_5486",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "We'll let the dust settle and then we'll have a discussion. Whether Dancing Gemini will stay a mile and a half around Epsom or maybe do you come back here over a mile and a quarter - there's lots to discuss. He's always had that kick and maybe he might have too much speed for a mile and a half, and coming here might be the wise thing. He'll have come on for today and he's had no prep - Roger Teal, trainer."
            },
            {
              "date": "2023-09-15",
              "horse": "Dancing Gemini",
              "horse_id": "5146206",
              "race": "Betfred Flying Scotsman Stakes (Listed Race)",
              "race_id": "847656",
              "course": "Doncaster",
              "course_id": "crs_390",
              "distance_f": "7",
              "distance_y": "1546",
              "quote": "That was really impressive. We've held Dancing Gemini in high regard all year and he did a piece of work last week that was breathtaking. I knew we had him in good shape coming into today and I said to Lewis if he can back up that bit of work you'll be going pass that lollipop in front. It was a very nice performance. We won this with Tip Two Win and he could possibly be as good. He's got a similar profile, he's got speed, he's got a turn of foot and he's got a good cruising gear. He's in the Futurity here but we'll play it by ear, we'll see how he comes out of today. If all's well and the owner is happy we might take a punt on it. If not we'll leave him for next year, maybe do a trial and go on to the Guineas - Roger Teal, trainer."
            },
            {
              "date": "2023-08-19",
              "horse": "Dancing Gemini",
              "horse_id": "5146206",
              "race": "Chapel Down British EBF Maiden Stakes (GBB/IRE Incentive Race)",
              "race_id": "845838",
              "course": "Newbury",
              "course_id": "crs_936",
              "distance_f": "7",
              "distance_y": "1540",
              "quote": "Dancing Gemini in probably one of the nicest two-year-olds already. We don't get many but we know when we've got a good horse and I've got a lot of butterflies about this horse. He's still a tad green but he went away nicely and he was very professional - Roger Teal, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Dancing Gemini",
              "horse_id": "5146206",
              "quote": "He did a nice piece of work last Wednesday and it's all systems go now. He won't be doing anything too special between now and the race, just some healthy exercises. He's fit and he's ready, and we just want to keep him ticking over. He did us proud in the Lockinge when just pipped by Lead Artist so hopefully he can put in a similar performance.  10-06-25"
            }
          ],
