          "comment": "Rallied gamely to win the Lockinge and further Group 1 success is plausible; progressive",
          "spotlight": "Trailed home last behind Dancing Gemini at Sandown on reappearance but left that effort well behind to reverse the placings in the Lockinge on good to firm at Newbury, rallying gamely to beat him by a neck and take strike-rate to 4-9; progressive in the main and further Group 1 success from this Juddmonte colt looks very plausible; figures highly in calculations.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-05-17",
              "horse": "Lead Artist",
              "horse_id": "5831475",
              "race": "BoyleSports Lockinge Stakes (Group 1)",
              "race_id": "890438",
              "course": "Newbury",
              "course_id": "crs_936",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "Lead Artist has got a great deal of talent, but got stuck in the mud at Sandown last time. He got a peach of a ride from Oisin [Murphy]. I thought we'd been in the first three, but not necessarily win it.  The Queen Anne is the next obvious step, but we hope the weather doesn't get wet. He's got so much natural speed and the stiff mile of Ascot will suit him best - John Gosden, joint-trainer."
            },
            {
              "date": "2024-10-12",
              "horse": "Lead Artist",
              "horse_id": "5831475",
              "race": "Space Blues Darley Stakes (Group 3)",
              "race_id": "876755",
              "course": "Newmarket",
              "course_id": "crs_988",
              "distance_f": "9",
              "distance_y": "1980",
              "quote": "Lead Artist has always been a high-class horse and the form of his second at Doncaster time stacked up when the winner Kinross ran so well at Longchamp last weekend. As he now has this kind of trip on his compass, this opens up other options for next year - Barry Mahon, racing manager to owners Juddmonte."
            },
            {
              "date": "2024-08-02",
              "horse": "Lead Artist",
              "horse_id": "5831475",
              "race": "Bonhams Thoroughbred Stakes (Group 3)",
              "race_id": "872002",
              "course": "Goodwood",
              "course_id": "crs_546",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "When you're drawn one here and the cutaway is gone you'd better get out and get a position so you don't get boxed in. Lead Artist controlled the race, dominated it very well and has improved greatly. He didn't like the ground at Newmarket because it was too soft. Hopefully he's good enough to come back to the Celebration Mile here. He missed all of last year. His first start was in the Wood Ditton. He's a horse on the upward curve and there's plenty of racing to come. If he gets better and better he could be a lovely four-year-old too - John Gosden, joint-trainer."
            },
            {
              "date": "2024-05-17",
              "horse": "Lead Artist",
              "horse_id": "5831475",
              "race": "Darley EBF Novice Stakes (For horses With No More Than Two Runs) (GBB Race)",
              "race_id": "865680",
              "course": "York",
              "course_id": "crs_2782",
              "distance_f": "8",
              "distance_y": "1732",
              "quote": "Lead Artist is a good-looking horse, we've always liked him but we couldn't run him last year. He's come on from the Wood Ditton. The last furlong was his best furlong and I think a stiff mile is his game right now - John Gosden, joint-trainer."
            }
          ],
