          "comment": "May still rate higher, being lightly raced and well bred (both parents won Group 1s)",
          "spotlight": "Dual winner over 1m at Ascot (Listed and Group 2); made all at Longchamp (Listed) on seasonal debut, taking record to 5-7; the two defeats came at the top level last term, running creditably in the Marois then below par in soft-ground QEII; has something to find in this field but may still rate higher, being lightly raced and well bred (both parents won Group 1 races).",
          "medical": [],
          "quotes": [
            {
              "date": "2024-08-11",
              "horse": "Quddwah",
              "horse_id": "5038626",
              "race": "Prix du Haras de Fresnay-le-Buffard Jacques le Marois (Group 1) (3yo+ No Geldings) (Straight Course)",
              "race_id": "874440",
              "course": "Deauville",
              "course_id": "crs_5356",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "I thought Quddwah ran super, obviously lacking experience going into a championship race. The ground was a little bit quick for him and I think his career is all ahead of him. I think it was a very solid run and we'll look forward to seeing him on his next start. We'll talk to [owner] Sheikh Ahmed and see what he wants to do, but an obvious next race would be the Leopardstown Mile - Simon Crisford, joint-trainer."
            },
            {
              "date": "2024-05-01",
              "horse": "Quddwah",
              "horse_id": "5038626",
              "race": "Bet With Ascot Donation Scheme Paradise Stakes (A Queen Anne Stakes Trial) (Listed Race)",
              "race_id": "864495",
              "course": "Ascot",
              "course_id": "crs_52",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "Quddwah won at Newmarket nicely and we were due to run him at the July meeting in a Listed race, but just before he got a little issue and we had to put him away. However, he'd always shown he was a horse on the up. We'll have to see what Sheikh Ahmed [Al Maktoum, owner] wants to do but the Diomed is probably the next step up. He's a bit immature and Epsom might be a lot, but we have to look at what the options are and he just wants bringing along in a nice manner. He is in the Queen Anne and I don't think I'd have reservations about that, because he'll come on a lot from this and it just depends on what happens in the next few weeks. This is only his third race, so he's still got his whole future ahead of him. He's a very nice horse to have in the stable. He picked up well and finished off nicely, showing a lovely turn of foot. I think today's small field with this ground was the perfect start of him - Ed Crisford, joint-trainer."
            },
            {
              "date": "2023-05-04",
              "horse": "Quddwah",
              "horse_id": "5038626",
              "race": "William Hill Lengthen Your Odds Novice Stakes (GBB Race)",
              "race_id": "836988",
              "course": "Salisbury",
              "course_id": "crs_1352",
              "distance_f": "7",
              "distance_y": "1533",
              "quote": "Quddwah had to be quite brave as the second took us off a line a bit but he showed a real likeable attitude. I'd never sat on him, but he's got a good pedigree and will go further - he's got a lovely relaxed character and should improve for further. The ground is on the dead side of good, it's not bad, and rode quite nice on him. The third horse gives some substance to the form and I'd say the race will work out. He's got a bit of quality - James Doyle, jockey."
            }
          ],
