          "damsire_id": "dsi_4690833",
          "damsire_region": "IRE",
          "trainer": "Richard Hannon",
          "trainer_id": "trn_259083",
          "trainer_location": "Herridge, Wilts",
          "trainer_14_days": {
            "runs": "52",
            "wins": "5",
            "percent": "10"
          },
          "owner": "Sheikh Mohammed Obaid Al Maktoum",
          "owner_id": "own_221344",
          "prev_trainers": [],
          "prev_owners": [],
          "comment": "Record of 2-2 at Ascot includes a win in the 2024 St James's Palace Stakes; respected",
          "spotlight": "Talented colt who normally travels and quickens and is suited by good ground or firmer; sparkled in a truncated 2024 campaign that featured wins, looking better than the bare form, in the Irish 2,000 Guineas and St James's Palace Stakes (latter took his Ascot record to 2-2); looked set to scale even greater heights in the 1m division but subsequently met with a setback; respected back at Royal Ascot with Lockinge reappearance (third behind race-fit rivals) under his belt.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-05-17",
              "horse": "Rosallion",
              "horse_id": "4924436",
              "race": "BoyleSports Lockinge Stakes (Group 1)",
              "race_id": "890438",
              "course": "Newbury",
              "course_id": "crs_936",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "I was pleased with the run, but there is match fitness and Rosallion go very well at Ascot. Of course I'm disappointed not to win, but I'm sure in a few hours we'll realise he's run a very good race. He's still an extremely good horse and he'll strip a lot fitter next time and take a lot of beating. I'm looking forward to Ascot - Richard Hannon, trainer."
            },
            {
              "date": "2024-06-18",
              "horse": "Rosallion",
              "horse_id": "4924436",
              "race": "St James's Palace Stakes (Group 1) (Colts) (British Champions Series)",
              "race_id": "865757",
              "course": "Ascot",
              "course_id": "crs_52",
              "distance_f": "8",
              "distance_y": "1753",
              "quote": "I knew it was going to be a bit tactical. Rosallion had to be good today and I just knew the stiff track would suit me, and boy was he good. He travelled so well and he picked up strongly - when he has something to aim at he tries. I'm hoping one day they go a really good gallop and he gets to show his true potential because at the moment he's shown how versatile he is - Sean Levey, jockey."
            },
            {
              "date": "2024-05-25",
              "horse": "Rosallion",
              "horse_id": "4924436",
              "race": "Tattersalls Irish 2,000 Guineas (Group 1)",
              "race_id": "850331",
              "course": "Curragh",
              "course_id": "crs_4628",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "Rosallion was a bit keen early. It took him a bit of time to pick him up, but he's such a hyped horse, he's not going to please everybody. It's on to Ascot now for the St James's Palace and hopefully he will be in training next year. These days are very rare, we will enjoy it. Haatem is so brave, he has run such a lovely race. He didn't really deserve to get beat but his day will come. I just love him, he's really smashing and a pleasure to have. If anything he has emerged with maybe more credit than the winner and his day will come. I think he will stay further - Richard Hannon, trainer."
            },
            {
              "date": "2024-05-04",
              "horse": "Rosallion",
              "horse_id": "4924436",
              "race": "Qipco 2000 Guineas Stakes (Group 1) (No Geldings) (British Champions Series)",
              "race_id": "861256",
              "course": "Newmarket",
              "course_id": "crs_988",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "Rosallion travelled so well and he got to the front and looked like he was going to win. I don't think he needed it - he hasn't blown up as he has done loads of work. He's still an extremely good horse and I'd love to take the winner on again around a bend at Royal Ascot in the St James's Palace Stakes and we'll also look at going to Ireland. I think this is probably the best Guineas we have seen in ten years - Richard Hannon, trainer."
            },
            {
              "date": "2023-10-01",
              "horse": "Rosallion",
              "horse_id": "4924436",
              "race": "Qatar Prix Jean-Luc Lagardere (Grand Criterium) (Group 1) (2yo Colts & Fillies) (New Course) (Turf)",
              "race_id": "850996",
              "course": "Longchamp",
              "course_id": "crs_5486",
              "distance_f": "7",
              "distance_y": "1540",
              "quote": "It took a lot of braveness to bring Rosallion here on the back of a disappointing run last time. We always thought he was good and felt the soft ground was the reason he ran like he did last time. We were worried about the draw and he's done really well to win from there (stall ten). We've been going through this year with next year's Guineas in mind; that's the belief we have in him - Sean Levey, rider."
            },
            {
              "date": "2023-06-07",
              "horse": "Rosallion",
              "horse_id": "4924436",
              "race": "Get A Run For Your Money At BetVictor Maiden Stakes (GBB Race) (Div I)",
              "race_id": "840681",
              "course": "Newbury",
              "course_id": "crs_936",
              "distance_f": "6.5",
              "distance_y": "1430",
              "quote": "Rosallion is a lovely colt. The ground was plenty quick enough for him and he'll get further, but he's a very nice horse for next year and this year. We'll see how he comes out of this as regards to Ascot, but I think he's very nice - Richard Hannon, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Rosallion",
              "horse_id": "4924436",
              "quote": "A flag-bearer for us last year with his wins in the Irish Guineas and St James's Palace. Unfortunately, he had some form of near pneumonia but he's come back looking fantastic and Timmy Murphy, who rides him every day, says he's in the best form he's ever been in. The proof only comes when we start racing, though, and the plan is the Lockinge - although he won't go anywhere near soft ground - then Queen Anne and Sussex, before we start thinking about the end of the season. 22-04-25"
            }
          ],
