          "comment": "Very progressive; scored over C&D on Royal Ascot trials day; interesting back here",
          "spotlight": "Stablemate of Lead Artist; form figures read 211112; made great strides on Southwell AW last term and bagged Listed honours over C&D (good to firm) on Royal Ascot trials day on reappearance, beating Docklands (pair clear); ran creditably in the Prix d'Ispahan at Longchamp (1m1f, good to soft) since, worn down towards the finish by a highly notable rival (the current Arc favourite) having looked the likely winner for some of the straight; could well rate higher still and is very interesting with the return to 1m looking ideal.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-04-30",
              "horse": "Sardinian Warrior",
              "horse_id": "5476931",
              "race": "eventmasters.co.uk Paradise Stakes (A Queen Anne Stakes Trial) (Listed Race)",
              "race_id": "891569",
              "course": "Ascot",
              "course_id": "crs_52",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "I think Sardinian Warrior is a top-level horse. It would have taken a nice one to win today as there were some proper hardened yardsticks in there, so he had to run to his rating. There's improvement to come and that was a good effort. I haven't sat on him at home this year but I really liked him when he won his last start and I thought he had plenty of potential. He picked up and quickened really well - Kieran Shoemark, jockey."
            },
            {
              "date": "2024-04-28",
              "horse": "Sardinian Warrior",
              "horse_id": "5476931",
              "race": "Boost Your Football Acca At Planet Sport Bet Novice Stakes (GBB Race)",
              "race_id": "864623",
              "course": "Southwell (AW)",
              "course_id": "crs_10244",
              "distance_f": "8",
              "distance_y": "1773",
              "quote": "Sardinian Warrior did everything I expected of him. He was in front a long way from home, he was still green and he possibly got tired. I always knew he was going to come on for today so that was very encouraging - Kieran Shoemark, jockey."
            }
          ],
