          "comment": "Second to Andab on debut but then impressed from a difficult draw at Listowel; has claims",
          "spotlight": "Looked raw when no match for Andab on Curragh debut (6f, good) and then overcame a wide draw over slightly further at Listowel (good to yielding), mowing down the favourite who had shaped well in a good race the time before; trainer is seeking a third Royal Ascot victory; each-way claims.",
