          "comment": "Produced all his best work late on to win at Navan and once-raced colts win Coventrys",
          "spotlight": "Sired by Royal Ascot winner Starspangledbanner and is a half-brother to top-class 2yo sprinter Vandeek; cost 450,000gns as a foal; produced all his best work late on at Navan (6f, good) when flooring a once-raced odds-on stablemate who is bound for Wednesday's Queen Mary; this colt could have come on in leaps and bounds for that first run, in keeping with so many from this yard; there's been money for him in the last week and many a once-raced colt has won this; Ryan Moore rides.",
