          "comment": "Both wins over 5f, the latest here; he was holding on that day and is now up in distance",
          "spotlight": "An unbeaten son of Wootton Bassett with course experience, having given weight and a beating to subsequent winners over 5f here (good to firm) last time; his powerful yard's chosen one for this, but the nagging concern is that his final furlong of that last race wasn't his best and he's up to 6f this time.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-05-10",
              "horse": "Military Code",
              "horse_id": "7413941",
              "race": "Peroni Nastro Azzurro 0.0% Novice Stakes (GBB Race)",
              "race_id": "892685",
              "course": "Ascot",
              "course_id": "crs_52",
              "distance_f": "5",
              "distance_y": "1100",
              "quote": "I'd expect Military Code to improve and it'll be interesting to see where he goes next, whether it's over five or six furlongs. He's got plenty of speed for five furlongs, but I do think he will stay six - William Buick, jockey."
            },
            {
              "date": "2025-04-17",
              "horse": "Military Code",
              "horse_id": "7413941",
              "race": "British Stallion Studs EBF Novice Stakes (GBB Race)",
              "race_id": "890402",
              "course": "Newmarket",
              "course_id": "crs_988",
              "distance_f": "5",
              "distance_y": "1100",
              "quote": "We came here with a bit of confidence, although he went on the drift in the market, which is probably just been the week we've had. Military Code had done some nice work, as a physical specimen you can't fault him and we've got a couple of two-year-olds around him that we like as well so hopefully they're a little group who will come along together. He was a bit green at the start but he's done it professionally and picked up well. We'd hoped he'd be an Ascot type - Charlie Appleby, trainer, speaking to Racing TV."
            }
          ],
