          "comment": "Cost 270,000gns as a yearling and blew them away with a 5l stroll at Yarmouth; exciting",
          "spotlight": "Cost 270,000gns as a yearling; bred to go further but he didn't look short of speed when waving goodbye to the opposition at Yarmouth (6f, good to firm) and the runner-up, who cost some 500,000gns as a yearling, didn't appear to be unfancied; the time wasn't mind-blowing but he looks hugely exciting, especially as connections expected him to come on plenty for that initial experience; James Doyle prefers him to Underwriter who runs in the same colours.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-05-22",
              "horse": "Postmodern",
              "horse_id": "7551823",
              "race": "British Stallion Studs EBF Novice Stakes (GBB Race)",
              "race_id": "893832",
              "course": "Yarmouth",
              "course_id": "crs_2704",
              "distance_f": "6",
              "distance_y": "1323",
              "quote": "I'm delighted for Hamad [Al Jehani, trainer] and his team as they've done a great job with Postmodern. He'd done some nice work at home but he hadn't been asked to do too much, so we thought he'd run well, but we weren't expecting that at all. It looked like a good race. I've not spoken to Jamie [Spencer, jockey] or Hamad yet but it's hard not to be excited by the way he won. Without a shadow of a doubt he's one of our exciting juveniles. It's rare they go and win like that and I imagine he'd go straight to the Coventry now - Richard Brown, owners' representative."
            }
          ],
