          "comment": "Close second in the Marble Hill last time and a case can be made for him being overpriced",
          "spotlight": "All three runs at the Curragh, on soft and good; impressed on debut, then ran third in a 5f Listed race and latterly saw out the 6f well to finish within a length of Albert Einstein in the Marble Hill (Andab third); that Group 3 is traditionally a strong Irish pointer and the winner would probably have been favourite for this had he not been sidelined through injury; a case can be made for this colt being overpriced.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-03-16",
              "horse": "Power Blue",
              "horse_id": "7204797",
              "race": "Castle Star At Capital Stud Irish EBF Maiden",
              "race_id": "890272",
              "course": "Curragh",
              "course_id": "crs_4628",
              "distance_f": "5",
              "distance_y": "1100",
              "quote": "It's a bit of a usual thing with Adrian [Murray] and his team winning this race! Power Blue was well prepared and he was the ultimate professional really. He showed a little bit of greenness but he really quickened up the last hundred yards and galloped out all the way to the boards so he'll be getting a bit further than five furlongs, that's for sure. Why not? [when asked whether he could emulate the achievements of previous recent winners of this race]. He won by a wider margin today than Arizona Blaze, who was a Breeders' Cup placed horse and Bucanero Fuerte probably won in similar fashion. He's a nice horse and there's sure to be plenty of improvement - David Egan, jockey, speaking to Racing TV."
            }
          ],
          "stable_tour": [
            {
              "horse": "Power Blue",
              "horse_id": "7204797",
              "quote": "He's run some very good races, including when second to Albert Einstein last time, and we think he'll go very close in the Coventry. He and Arizona Blaze are probably our best chances. 13-06-25"
            }
          ],
