          "comment": "Coming along nicely but he's in a lot deeper here and may lack the required class",
          "spotlight": "Likeable efforts here and at York before getting off the mark at the latter venue 17 days ago (6f, good) when pretty much all out to repel Do Or Do Not; coming along nicely but he's in a lot deeper here and may lack the required class, no matter what difference the new cheekpieces make.",
