          "quotes": [
            {
              "date": "2025-05-31",
              "horse": "Tadej",
              "horse_id": "7436351",
              "race": "Irish Thoroughbred Marketing EBF Restricted Novice Stakes (Bands A, B, C & D) (Qual') (GBB/IRE Inc)",
              "race_id": "894055",
              "course": "York",
              "course_id": "crs_2782",
              "distance_f": "6",
              "distance_y": "1320",
              "quote": "It's nice Tadej going to Royal Ascot with a win under his belt. He was unlucky on debut at Ascot when he was drawn on the wing and got just a bit lonely - he'd have won if he was drawn a bit better. He's mentally quite immature but he knuckled down hard. He's got plenty of ability beneath the bonnet and is still very unfurnished. The stiff six at Ascot will be perfect and he's shown he can handle the big occasion. If he can take another step in the right direction, hopefully he'll run well. We rate him very highly and is one of our nicer colts. As far as the early types go, he was always high on the list - Hollie Doyle, jockey."
            }
          ],
