          "comment": "Unbeaten in two visits to Chester, impressing both times; this is a very different test",
          "spotlight": "Zipping around the tight bends of Chester is a world away from the straight track at Ascot, but it's all been straightforward for him there on the Roodee and he had little difficulty in defying a penalty last time, despite a wide enough draw; he's not the biggest, but the booking of Colin Keane is a statement of intent; The Wow Signal won out of stall 1 in 2014.",
