          "comment": "Made outstanding progress in 5f handicaps and hampered behind Mgheera in a Group 2 since",
          "spotlight": "Made outstanding progress in 5f handicaps and the way he raced to the front at York (good to firm) in May showed that a switch to Group company wouldn't be at all fanciful; unable to show what he was made of behind Mgheera in a Group 2 at Haydock (5f, good) since, as a gap shut as he was about to go through it, and he remains one to keep on the right side.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-05-15",
              "horse": "American Affair",
              "horse_id": "5029048",
              "race": "Lindum York Handicap",
              "race_id": "892764",
              "course": "York",
              "course_id": "crs_2782",
              "distance_f": "5",
              "distance_y": "1100",
              "quote": "It's probably American Affair's last go in a handicap. He's done nothing but improve and started off last year in the mid-70s, but the more racing he's had the sharper he's got. He just shuts down when he hits the front and is still quite raw. Jim said we'd learn a lot more about him today as there's no easy five-furlong race here. He's proved he's up to going to the next level - Paul Mulrennan, rider."
            },
            {
              "date": "2025-04-19",
              "horse": "American Affair",
              "horse_id": "5029048",
              "race": "Virgin Bet Daily Price Boosts Scottish Sprint Cup Handicap",
              "race_id": "890417",
              "course": "Musselburgh",
              "course_id": "crs_416",
              "distance_f": "5",
              "distance_y": "1101",
              "quote": "We probably have to go into Group races. There's the King Charles over five furlongs at Ascot, which would be okay. I don't think we'll go to Newmarket but American Affair is a good horse and he's maturing - Jim Goldie, trainer."
            },
            {
              "date": "2024-09-14",
              "horse": "American Affair",
              "horse_id": "5029048",
              "race": "Betfred Portland (Heritage Handicap)",
              "race_id": "874764",
              "course": "Doncaster",
              "course_id": "crs_390",
              "distance_f": "5.5",
              "distance_y": "1243",
              "quote": "American Affair has done nothing but improve all year. Jim Goldie is some trainer. The last couple of races he's been running with the choke out and not really finishing. Jim said today to ride him ice cold, I got him to switch off and he finished really well. What will he be like next year with another winter on his back? He's still very babyish and raw - Paul Mulrennan, jockey."
            },
            {
              "date": "2024-04-21",
              "horse": "American Affair",
              "horse_id": "5029048",
              "race": "Sky Bet For The Fans Handicap",
              "race_id": "863445",
              "course": "Musselburgh",
              "course_id": "crs_416",
              "distance_f": "5",
              "distance_y": "1101",
              "quote": "American Affair is a homebred and as he came off the box, I said to him, 'Your granny [Class Wan] won here' and we've had a few generations of this breed. From where he was drawn [13], Paul got the rail and kind of bossed it - Jim Goldie, trainer, speaking to ITV Racing."
            },
            {
              "date": "2023-05-16",
              "horse": "American Affair",
              "horse_id": "5029048",
              "race": "Watch Racing TV In Stunning HD Restricted Novice Stakes (For horses In Bands C And D) (GBB Race)",
              "race_id": "838252",
              "course": "Wetherby",
              "course_id": "crs_2262",
              "distance_f": "7",
              "distance_y": "1540",
              "quote": "American Affair is a work in progress but the uphill finish and the step up to seven played to his strengths. He's a big horse and there should be a lot more to come from him - Paul Mulrennan, jockey, speaking on Racing TV."
            }
          ],
          "stable_tour": [
            {
              "horse": "American Affair",
              "horse_id": "5029048",
              "quote": "He's very talented. We hoped he would bounce back the way he did at Musselburgh and he'll improve for it. We're excited. He'll probably go to York for a 5f handicap next but I've put him in the Temple Stakes and the King Charles at Royal Ascot. We'll probably stick to 5f at the moment. I think he's up to that class over five and he's a simpler ride over that trip. He appears very fast and seems to be comfortable at that pace. 07-05-25"
            }
          ],
