          "prev_trainers": [],
          "prev_owners": [],
          "comment": "Won Group 2 (5f) last May; creditable efforts in Group 1s later but plenty more needed",
          "spotlight": "Went to a new level when winning a Group 2 at Haydock (5f, soft) last May but taking the next step proved beyond him in Group 1s later, such as when fifth of 17 in this race (good to firm) and fourth at the Curragh (5f, good); out the back on comeback at York and later targets should prove more suitable.",
          "medical": [],
          "quotes": [
            {
              "date": "2024-05-25",
              "horse": "Kerdos",
              "horse_id": "4589979",
              "race": "Betfred Temple Stakes (Group 2)",
              "race_id": "865755",
              "course": "Haydock",
              "course_id": "crs_598",
              "distance_f": "5",
              "distance_y": "1100",
              "quote": "Kerdos is better than he'd shown so far this year. He's a nice horse going forward. He's the sort of horse Clive does supremely well with - Richard Kingscote, jockey."
            },
            {
              "date": "2023-09-02",
              "horse": "Kerdos",
              "horse_id": "4589979",
              "race": "William Hill Beverley Bullet Sprint Stakes (Listed Race)",
              "race_id": "846702",
              "course": "Beverley",
              "course_id": "crs_156",
              "distance_f": "5",
              "distance_y": "1100",
              "quote": "Kerdos is very promising and has always had a lot of talent. It was more a case of fine tuning everything. This track played to his strengths, he has a really big kick and he's hardly had a blow there. He's in the Abbaye and if the ground was nice who knows, but really all arrows point to next year for him - Clive Cox, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Kerdos",
              "horse_id": "4589979",
              "quote": "He's won at the track and was third in last year's Commonwealth Cup. He was only sixth on his reappearance at Haydock but he didn't have a great lead-up with a bruised foot and he was a little bit fresh, so I'd hope he can take a big step forward from that. 10-06-25"
            },
            {
              "horse": "Kerdos",
              "horse_id": "4589979",
              "quote": "He's by our King's Stand winner Profitable who is turning out some lovely individuals. He made the perfect start to his career last year winning both starts, over 6f at Haydock and Windsor. He has not added to those this season but only lost by a head at Lingfield and more recently a neck in the 26-runner Palace of Holyroodhouse Stakes at Royal Ascot when runner-up. Since then, he was drawn out on the wing at York and didn't fire behind Nymphadora on ground that was possibly too much on the easy side. I have a lot of confidence in him and I think when he gets more experience he could progress into a proper 5f horse. If things were to fall into place this week he could be in the Goodwood team for the King George Stakes on Friday, but not if the rain has a major say in the going. 02-08-23"
            }
          ],
          "number": "4",
          "draw": "3",
