          "comment": "Progressive in 2022 but ran only once as a 4yo; likely to be rusty after two-year absence",
          "spotlight": "Progressive 3yo in 2022 when a Listed C&D win was surpassed by only a Group 3 AW success later that year; he was seen only once as a 4yo though and not at all since, so it's likely he will be very rusty today.",
          "medical": [],
          "quotes": [
            {
              "date": "2023-05-06",
              "horse": "Manaccan",
              "horse_id": "3593785",
              "race": "Howden Palace House Stakes (Group 3)",
              "race_id": "837019",
              "course": "Newmarket",
              "course_id": "crs_988",
              "distance_f": "5",
              "distance_y": "1100",
              "quote": "Manaccan handles soft ground but he is better on fast ground and this sort of ground tests your fitness first time out. I think we will go to the King's Stand Stakes at Royal Ascot now as I think that is the right race to go. York would come too soon so we will go to Ascot. He likes Ascot as he has won there a few times so let's go there where he is good - John Ryan, trainer."
            },
            {
              "date": "2022-10-21",
              "horse": "Manaccan",
              "horse_id": "3593785",
              "race": "Al Basti Equiworld, Dubai Pat Smullen Mercury Stakes (Group 3)",
              "race_id": "823090",
              "course": "Dundalk (AW)",
              "course_id": "crs_29588",
              "distance_f": "5",
              "distance_y": "1100",
              "quote": "We train on an all-weather surface and we know Manaccan is a faster-ground horse rather than a soft-ground horse. I know everyone gets excited because the Breeders' Cup is around the corner, but it is not on my wavelength at the moment. That will be another day - John Ryan, trainer."
            },
            {
              "date": "2022-10-01",
              "horse": "Manaccan",
              "horse_id": "3593785",
              "race": "Oakman Inns Rous Stakes (Listed Race)",
              "race_id": "820617",
              "course": "Ascot",
              "course_id": "crs_52",
              "distance_f": "5",
              "distance_y": "1100",
              "quote": "That was a very gutsy ride by Stevie on Manaccan. The ground was always going to be against us and Stevie had to deviate from his draw to find the right horses to follow. It was a ballsy ride and I thought the horse was unlucky at Newbury last time. I think he's a serious horse over 5f and he'll be even better on quicker ground. We'll hopefully go to Dundalk for a Group 3 on October 21 next and then we'll see - he could be one of the best I've trained - John Ryan, trainer."
            },
            {
              "date": "2022-09-07",
              "horse": "Manaccan",
              "horse_id": "3593785",
              "race": "Cazoo Scarbrough Stakes (Listed Race)",
              "race_id": "818738",
              "course": "Doncaster",
              "course_id": "crs_390",
              "distance_f": "5",
              "distance_y": "1103",
              "quote": "I think a lot of Manaccan - we always have - and he's the best one I've had for a while. His ideal trip is five as he's got a high cruising speed and a turn of foot and I think he's going to be a better horse next year. If the ground stays okay we'll go to Newbury on September 17 for the International Trophy - John Ryan, trainer."
            },
            {
              "date": "2022-08-06",
              "horse": "Manaccan",
              "horse_id": "3593785",
              "race": "Dubai Duty Free Shergar Cup Dash (Handicap)",
              "race_id": "816798",
              "course": "Ascot",
              "course_id": "crs_52",
              "distance_f": "5",
              "distance_y": "1100",
              "quote": "Manaccan is a lovely horse and we really wanted to go for a Listed race at Chester last week, but the ground went on us. I was prepared to go on good to soft, but wouldn't risk anything slower. He's definitely black type material, but he just needs his ground - John Ryan, trainer."
            }
          ],
