          "comment": "4-4 on AW (7f/6f); faded over 6f on turf last month; enough speed for 5f; still intriguing",
          "spotlight": "Dynamic on AW and was much too swift for his rivals when making it 4-4 (7f and 6f) in a Listed race in November; the return to turf didn't come off when again trying to make all in a Group 2 at York (6f, good to firm) in May when he was a sitting duck late on; however, AW specialists often run well here and he should have the speed for the drop to 5f; remains intriguing.",
