          "quotes": [
            {
              "date": "2024-11-16",
              "horse": "Night Raider",
              "horse_id": "5186089",
              "race": "BetUK Golden Rose Stakes (Listed Race)",
              "race_id": "879256",
              "course": "Newcastle (AW)",
              "course_id": "crs_35178",
              "distance_f": "6",
              "distance_y": "1320",
              "quote": "Night Raider was very comfortable going a good gallop. He beat two decent benchmarks in Wiltshire and Annaf - Oisin Murphy, speaking to Sky Sports Racing."
            },
            {
              "date": "2024-03-20",
              "horse": "Night Raider",
              "horse_id": "5186089",
              "race": "Boost Your Acca At BetMGM Novice Stakes (GBB Race)",
              "race_id": "861352",
              "course": "Southwell (AW)",
              "course_id": "crs_10244",
              "distance_f": "7",
              "distance_y": "1554",
              "quote": "The idea was to go straight to the Guineas with a racecourse gallop at the Craven meeting. Another run is probably the right thing to do, Danny [Tudhope, jockey] said Night Raider could do with another run, he's still green in front but he's obviously a very good horse - Karl Burke, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Night Raider",
              "horse_id": "5186089",
              "quote": "He's been purchased by Wathnan and the plan is the King Charles III Stakes. He got tired late on in the Duke of York Stakes but he was galloping into a headwind and the ground was probably a little bit tacky for him. He's come out of the race in great shape and all he's done is get quicker and quicker. I'm excited to run him over five furlongs and I think he has a lot of ability.   12-06-25"
            }
          ],
