          "spotlight": "An infrequent winner but he's been a fine sprinter in his time and has run with great credit in the last three runnings of this race, finishing second, fourth and sixth; whether he can reproduce those efforts after finishing well held in two runs for new yard looks unlikely.",
          "medical": [],
