              "distance_f": "5",
              "distance_y": "1100",
              "quote": "Twilight Calls is getting better. He loves really rattling fast ground, but you can't blame the ground today. He wasn't totally lucky in-running but take nothing away from the winner. Adam [Kirby] said the faster they go the better and I think if Wesley Ward appears at Ascot, that shouldn't be a problem. They go a million miles an hour [in the King's Stand] and hopefully it will be firm ground as well - Henry Candy, trainer."
