          "owner_id": "own_846216",
          "prev_trainers": [],
          "prev_owners": [],
          "comment": "Capable at the right level over 5f and 6f but not yet a Group 1 contender; an onlooker",
          "spotlight": "Capable at the right level over both sprint trips but he's been vulnerable in the better races and had every chance when a one-paced third of 11 to Mgheera in a Haydock Group 2 (5f, good) in May; an onlooker again.",
          "medical": [],
          "quotes": [
            {
              "date": "2024-04-18",
              "horse": "Washington Heights",
              "horse_id": "4175592",
              "race": "Connaught Access Flooring Abernant Stakes (Group 3)",
              "race_id": "863377",
              "course": "Newmarket",
              "course_id": "crs_988",
              "distance_f": "6",
              "distance_y": "1320",
              "quote": "We were looking forward to running Washington Heights today and he is a horse that tries very, very hard in his races. He has run loads of good races for us and probably just been a bit unlucky here and there. He had done well over the winter and we were really looking forward to this year. He was impressive when he won in Sweden last year and we were hoping he'd outrun his odds today. Tom has given him a great ride from the front and got the job done. Kevin is a fantastic trainer of fast horses and it looks like he's bought another nice one for us. He's in the Duke of York and Greenlands in Ireland and we could look at Royal Ascot further down the line. We will see what the boss says - Cosmo Charlton, racing manager for owners Hambleton Racing."
            },
            {
              "date": "2023-09-17",
              "horse": "Washington Heights",
              "horse_id": "4175592",
              "race": "Bro Park Sprint Championship (Listed Race) (3yo+) (Turf)",
              "race_id": "850096",
              "course": "Bro Park",
              "course_id": "crs_35334",
              "distance_f": "6",
              "distance_y": "1320",
              "quote": "All fairness goes to Simon Turner, who runs Hambleton Racing. They've supported this meeting and had success out here before. He came up with the idea and thankfully it's paid off. Washington Heights is so tough and genuine, he deserved to win one like that. He's been a bit unfortunate this year. He bumped into Shaquille at the start of the year and you've seen what he's gone on to do. He's had his day in the sun today. Thankfully we had a few owners out here as well who enjoyed it. He's been at the top table in these handicaps all year, so I'm sure there's more races in him - Adam Ryan, trainer's assistant."
            },
            {
              "date": "2022-06-22",
              "horse": "Washington Heights",
              "horse_id": "4175592",
              "race": "Scaleby Restricted Maiden Stakes (For Horses In Bands B, C And D) (GBB Race)",
              "race_id": "813667",
              "course": "Carlisle",
              "course_id": "crs_208",
              "distance_f": "5",
              "distance_y": "1100",
              "quote": "It was a lovely run at Wetherby and Washington Heights has improved for it as he's quite laid back at home and he's obviously going to come on a lot for that fitness wise too, so we were hoping today that he was going to run a big race again - Kevin Ryan, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Washington Heights",
              "horse_id": "4175592",
              "quote": "He was a shade unlucky at York as the ground just went against him. If it had been a bit faster, he'd have taken some pegging back. His win in the Abernant proved he was up to Group class and that last run teed him up nicely for the big sprints. 10-06-24"
            }
          ],
