          "comment": "Progressive and her Listed win (5f, good) was another step forward; tough call today",
          "spotlight": "Progressive 4yo who made great strides in the autumn with a hat-trick at about 5f on heavy and soft ground; a recent Listed win at Haydock (5f, good) suggests she's still improving, but this is likely to be hard labour.",
