              "distance_f": "5",
              "distance_y": "1100",
              "quote": "I was a little bit stuck in a pocket but the longer I was filling Balmoral Lady up the better and I just needed a little bit of room. When the gap came she was brave. She's got stronger over the winter and she's worthy of this level - Paul Mulrennan, rider."
