          "prev_trainers": [],
          "prev_owners": [
            {
              "owner": "Mrs John Magnier & Derrick Smith & Michael Tabor",
              "owner_id": "own_1406008",
              "change_date": "2025-04-04"
            },
            {
              "owner": "Highclere T'Bred Racing - Jane Addams",
              "owner_id": "own_1269284",
              "change_date": "2024-12-03"
            }
          ],
          "comment": "Close up in several top 5f races last year, including this one; looks sure to go well",
          "spotlight": "Very reliable mare who stood a tough 2024 season with fortitude, regularly on the premises in the top sprints, including when fourth, having every chance, in this one (the first of two runs at the meeting); she achieved more when going down only narrowly from a poor draw in the Group 1 Nunthorpe at York (5f, good to firm) in August; sold for 3,000,000gns in December; returned to action with a Group 1 win at Meydan (6f) in April and she looks set for another big run at the top level.",
          "medical": [
            {
              "date": "2022-11-10",
              "type": "Wind Surgery"
            }
          ],
          "quotes": [
            {
              "date": "2025-04-05",
              "horse": "Believing",
              "horse_id": "4290160",
              "race": "Al Quoz Sprint Sponsored By Azizi Developments (Group 1) (Turf)",
              "race_id": "892066",
              "course": "Meydan",
              "course_id": "crs_32006",
              "distance_f": "6",
              "distance_y": "1320",
              "quote": "George [Boughey, trainer] was very happy with Believing, he was very bullish. She'd had a faultless prep and he sounded as though he was confident she was a better filly heading into this year than she was last year. The race went how I saw it beforehand. This is a very fair track, she's a very uncomplicated filly. It was a smooth trip, she dug deep, she really did want it - William Buick, jockey."
            },
            {
              "date": "2024-08-23",
              "horse": "Believing",
              "horse_id": "4290160",
              "race": "Coolmore Wootton Bassett Nunthorpe Stakes (Group 1) (British Champions Series)",
              "race_id": "870566",
              "course": "York",
              "course_id": "crs_2782",
              "distance_f": "5",
              "distance_y": "1100",
              "quote": "I'm delighted. As we discussed before, Believing probably was on the wrong side. She just gets a bit outpaced at that crucial point. Nothing really took her into the race properly. It was a lovely ride from Ryan Moore and she was getting there with each stride. She'll head to the Flying Five, that's been the plan for a long time and I'm very proud of her. She's dancing every dance and I hope she'll pop up at some point - George Boughey, trainer."
            },
            {
              "date": "2024-08-02",
              "horse": "Believing",
              "horse_id": "4290160",
              "race": "King George Qatar Stakes (Group 2)",
              "race_id": "870559",
              "course": "Goodwood",
              "course_id": "crs_546",
              "distance_f": "5",
              "distance_y": "1100",
              "quote": "Believing is showing her tenacity every time. I was a little worried after a couple of furlongs she was out of her ground on the fastest five you run at this grade. She's still learning to sprint at this distance. She's carried a penalty, didn't have the easiest of runs and all options are open for her. Ryan Moore was pretty insistent she went to the Nunthorpe but the Flying Five has always been the plan and there's enough time for her to do both, but she'll govern that. She takes her races well and is still upwardly mobile - George Boughey, trainer."
            },
            {
              "date": "2024-07-20",
              "horse": "Believing",
              "horse_id": "4290160",
              "race": "Barberstown Castle Sapphire Stakes (Group 2)",
              "race_id": "870916",
              "course": "Curragh",
              "course_id": "crs_4628",
              "distance_f": "5",
              "distance_y": "1100",
              "quote": "Believing is a very straightforward filly and was probably entitled to win this - Ryan Moore, rider."
            },
            {
              "date": "2024-06-08",
              "horse": "Believing",
              "horse_id": "4290160",
              "race": "Betfred Passionate About Sport Achilles Stakes (Listed Race)",
              "race_id": "867993",
              "course": "Haydock",
              "course_id": "crs_598",
              "distance_f": "5",
              "distance_y": "1100",
              "quote": "That was very impressive. There was a strong headwind today and the favourite was running into the teeth of it, but we weren't sat that far behind. Believing will definitely run in the 5f race [at Ascot] and it wouldn't be the biggest surprise in the world if she also ran on the Saturday over six as well [Queen Elizabeth II Jubilee Stakes]. She's a very easy filly to train so if she's ok after Tuesday's race she could then run on the Saturday - George Boughey, trainer."
            },
            {
              "date": "2023-08-20",
              "horse": "Believing",
              "horse_id": "4290160",
              "race": "EBF Stallions Highfield Farm Flying Fillies' Stakes (Listed Race)",
              "race_id": "845872",
              "course": "Pontefract",
              "course_id": "crs_1196",
              "distance_f": "6",
              "distance_y": "1320",
              "quote": "Believing was dropping in grade here but was given a very good ride and is a talented filly. Craig Witheford and his team have done a super job with her because she was a bit of a nightmare in the stalls for a while. She's a Group 3 winner when things go right but she'd rear up and it's pretty hard to come back from that in a sprint. She's progressive and I think straight tracks are what she wants. It was nice to get her back on track and we'll step her back up in grade now. She has an entry in the Sprint at Ascot on Champions Day and that's her main target - George Boughey, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Believing",
              "horse_id": "4290160",
              "quote": "The plan is to go for the King Charles III, in which she was fourth last year. I couldn't have been much happier with how she trained during the spring heading into the Al Quoz at Meydan, which she won, and since then her work has been solid. She's become more straightforward and the guys have worked hard with her in the gates. Ryan Moore is set to ride and she should be bang there. She's probably going to be our shortest-priced runner of the meeting and it's great for that to be in a Group 1. 09-06-25"
            },
            {
              "horse": "Believing",
              "horse_id": "4290160",
              "quote": "Won back-to-back races in the spring, including the Group 3 Prix Texanita at Chantilly. She returned there this month but reared up in the stalls several times and eventually missed the break by five lengths. I need to get her stalls sorted out before we go again. She is in the Commonwealth Cup next week, a race in which fillies have a fine record, but I would not go unless she is absolutely right after recent travels. I will decide on whether she goes to the royal meeting much closer to the time. 14-06-23"
            }
          ],
