          "comment": "Smart sprinting 2yo who picked up two Group races at 5f; disappointing favourite on return",
          "spotlight": "Smart sprinting 2yo whose four 5f wins included a Group 3 at Longchamp (good to soft) and Group 2 at Doncaster (good), both from the front; has to put a disappointing reappearance at York (favourite) behind him in this much better race.",
          "medical": [],
          "quotes": [
            {
              "date": "2024-09-13",
              "horse": "Aesterius",
              "horse_id": "5929134",
              "race": "Carlsberg Danish Pilsner Flying Childers Stakes (Group 2)",
              "race_id": "874757",
              "course": "Doncaster",
              "course_id": "crs_390",
              "distance_f": "5",
              "distance_y": "1103",
              "quote": "Aesterius is a very talented horse. He won the d'Arenberg, he's come here 12 days later and backed it up. It's the same double we did with Soldier's Call. The Breeders' Cup will be his end of season target, that should really suit him. Do we have a crack at the Abbaye in the meantime? He's a course and distance winner at Longchamp and he'd get 18lb off his elders. Soldier's Call was only beaten a neck in it by Mab's Cross after winning and it's something we'll have a good discussion about - Archie Watson, trainer."
            },
            {
              "date": "2024-09-01",
              "horse": "Aesterius",
              "horse_id": "5929134",
              "race": "Prix d'Arenberg (Group 3) (2yo) (Sprint Course) (Turf)",
              "race_id": "876066",
              "course": "Longchamp",
              "course_id": "crs_5486",
              "distance_f": "5",
              "distance_y": "1100",
              "quote": "Aesterius bought a strong level of form into the race. Everything went smoothly and he won impressively, as I hoped he would. James was delighted with him and said it was very straightforward. He's a very talented colt. He's in the Abbaye, which we almost won with Soldier's Call as a two-year-old having won this race. We'll discuss that with the owners. The Breeders' Cup Juvenile Turf Sprint at Del Mar will be his final target of the season - Archie Watson, trainer."
            },
            {
              "date": "2024-07-31",
              "horse": "Aesterius",
              "horse_id": "5929134",
              "race": "Jaeger-Lecoultre Molecomb Stakes (Group 3)",
              "race_id": "871990",
              "course": "Goodwood",
              "course_id": "crs_546",
              "distance_f": "5",
              "distance_y": "1100",
              "quote": "Aesterius just raced away from the winner a bit, which happens in these big fields. He didn't get to race against Big Mojo but he's run a huge race and got his head down on the line. We'd love to finish the year at Del Mar, which would suit him. I'd imagine we'll go along the lines of the Prix d'Arenberg and then the Flying Childers - Archie Watson, trainer."
            },
            {
              "date": "2024-07-05",
              "horse": "Aesterius",
              "horse_id": "5929134",
              "race": "Dragon Stakes (Listed Race)",
              "race_id": "870375",
              "course": "Sandown",
              "course_id": "crs_1404",
              "distance_f": "5",
              "distance_y": "1110",
              "quote": "Aesterius ran a huge race at Royal Ascot. Like a lot of the races there, it was a bit affected by the draw. He raced against Whistlejacket the whole way, but still ran a huge race and was beaten just over a length. This was the obvious race with half an eye on Goodwood and he's sharpened up. James was very happy but we'd have preferred something better to lead us into the race. James was trying to keep hold of him so he didn't land in front three furlongs out. I'm sure he'll improve again with a strong pace to aim at. My immediate thought is he'd travel well in a Molecomb - Archie Watson, trainer."
            },
            {
              "date": "2024-05-24",
              "horse": "Aesterius",
              "horse_id": "5929134",
              "race": "M J Church Contracting Novice Stakes (GBB Race)",
              "race_id": "866739",
              "course": "Bath",
              "course_id": "crs_130",
              "distance_f": "5",
              "distance_y": "1110",
              "quote": "Aesterius is a lovely horse. He was very laid back. He's quick and has only been doing his work with older stakes sprinters. I haven't galloped him with a two-year-old. He'll only get quicker. All being well we'll look towards the Norfolk or the Windsor Castle depending on what the owners have - Archie Watson, trainer."
            }
          ],
