          "comment": "Second in a Group 3 (extended 5f) but needs major improvement for this first run over 5f",
          "spotlight": "Narrow winner of first two races as a 2yo but, even allowing for his second in a Group 3 (extended 5f, good to soft) in the first of two runs at Chantilly this season, he faces a steep uphill task in this first run over a bare 5f.",
          "medical": [],
          "quotes": [],
          "stable_tour": [
            {
              "horse": "Estepona",
              "horse_id": "6143238",
              "quote": "He works on Wednesday but at the moment the five-furlong race is the plan. I've always thought a lot of him and I think he'll turn out to be very good at this trip, though whether he's quite tough enough at this stage we will see. He's getting weight-for-age and we've seen this race fall to three-year-olds, including my own winner Equiano. I thought he ran well when he was third over six furlongs the other day because over that trip he needs to be covered up, otherwise he does too much too soon. He ended up following horses who didn't take him far enough into the race and found himself ten lengths adrift of the winner at one stage. He picked up really well and made up a lot of ground before paying for that late on, on a day when it worked out he wasn't drawn on the right part of the track. Back at five furlongs he won't need holding on to and I could see him running very well.  11-06-25"
            }
          ],
