          "comment": "Left 2yo form behind when breaking 5f track record at Meydan in January; not dismissed",
          "spotlight": "Had a promising, rather than stellar, 2yo season but he raised the bar when breaking the 5f track record in a Group 2 at Meydan (good to firm) in January, without having too hard a time either; he wasn't so overbearing when following up next time but this trip will suit better than the 6f he ran over when eighth to Believing there in April; not dismissed.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-03-01",
              "horse": "West Acre",
              "horse_id": "5708643",
              "race": "Nad Al Sheba Turf Sprint Sponsored By Emirates Skycargo (Group 3) (Turf)",
              "race_id": "889691",
              "course": "Meydan",
              "course_id": "crs_32006",
              "distance_f": "5",
              "distance_y": "1100",
              "quote": "It was certainly harder work [than the last race]. Ponntos got into his normal groove and was slightly away from us which maybe suited him but not us; it would have been nice to have direct aim at him. West Acre got away well and got into a nice position. He dug deep, was gritty and galloped out well after the line. I fancy he could be even better over the six furlongs of the Al Quoz Sprint - Callum Shepherd, jockey."
            },
            {
              "date": "2025-01-24",
              "horse": "West Acre",
              "horse_id": "5708643",
              "race": "Blue Point Sprint Presented By Longines (Group 2) (Turf)",
              "race_id": "886811",
              "course": "Meydan",
              "course_id": "crs_32006",
              "distance_f": "5",
              "distance_y": "1100",
              "quote": "It was a track record and an extraordinary performance. West Acre is a lightly raced horse and we thought he'd come on for his last run. I wanted to come back to five because he's all speed. He's got a huge engine and hopefully we can keep him safe and sound and more forward with the rest of the season out here. The obvious programme would be to go for the Nad Al Sheba on Super Saturday and the Al Quoz on World Cup night - George Scott, trainer."
            }
          ],
