          "owner": "Juddmonte",
          "owner_id": "own_1206684",
          "prev_trainers": [],
          "prev_owners": [],
          "comment": "Shade unlucky in the 2,000 Guineas and won the Irish version impressively; top rated",
          "spotlight": "Ran creditably on soft ground once, raced on good/firmer otherwise; progressive colt who won the Solario as a 2yo and Craven on reappearance; might have collared Ruling Court in the 2,000 Guineas if asked for his effort a tad sooner, then gained compensation in the Irish version where he strode clear for an impressive performance that puts him top rated in this field; bids to emulate his sire Kingman and the last two winners of this race by completing the Irish Guineas and St James's Palace Stakes double; excellent credentials.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-05-24",
              "horse": "Field Of Gold",
              "horse_id": "6088046",
              "race": "Tattersalls Irish 2,000 Guineas (Group 1) (No Geldings)",
              "race_id": "878186",
              "course": "Curragh",
              "course_id": "crs_4628",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "I was sorry to get beaten in the 2,000 Guineas when Field Of Gold finished so well, but to come on a plane and see something different, he'll have learned a lot, and they grow in mentality and in stature. Colin [Keane] rode him beautifully. In truth, I was concerned he might over-race with no cover on the outside, but I told Colin if he relaxes on the way down [to the start], he should relax on the way back. When he quickened he went, and it took two or three strides and he was off. Let's hope the owners want to go to Ascot and have a look at the St James's Palace Stakes - John Gosden, joint-trainer."
            },
            {
              "date": "2025-05-03",
              "horse": "Field Of Gold",
              "horse_id": "6088046",
              "race": "Betfred 2000 Guineas Stakes (Group 1) (No Geldings)",
              "race_id": "888179",
              "course": "Newmarket",
              "course_id": "crs_988",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "The race wasn't probably run in the fractions of the Craven Stakes and we were sat some way back. The winner has kicked and gone and we ran out of racetrack. Given another 25 yards the race would have been ours.    You'll probably find Field Of Gold has run a better race than he did in the trial but a trial is a trial. When this track gets fast like this it can ride slick with a crosstail wind and they can get away from you. It just got away from us, I'm afraid, as we came into the Dip from where he was clawing the ground back. I could see it was lost going into the Dip as we were just too far back and the winner got first run. We'll talk with the family about where we go next but I think you're looking at a St James's Palace Stakes after that - John Gosden, joint-trainer."
            },
            {
              "date": "2025-04-16",
              "horse": "Field Of Gold",
              "horse_id": "6088046",
              "race": "bet365 Craven Stakes (Group 3) (Colts & Geldings)",
              "race_id": "890389",
              "course": "Newmarket",
              "course_id": "crs_988",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "This is a trial, it's not the Guineas. You're not fully wound up for this, the race now puts them where you want them - that's the idea of the trial. He went to his girth and had a good blow, but then he's entitled to. Field Of Gold did it in splendid style and it's nice to race on some really good ground today and he just flew off it. It would be nice to win, but it's not something you necessarily worry about - I don't think about it at all. I suppose Kingman was slightly unfortunate as he went four lengths clear and thought he'd done enough and got caught late on by a very good horse in Night Of Thunder, who has become a top stallion. It's lovely to have a horse going for the Guineas and it's great for Juddmonte, because they have both the winner of the Greenham and this, so they're double-handed if they want to. But the family will decide whether one goes there and one goes to France or what we do - John Gosden, joint-trainer."
            },
            {
              "date": "2024-10-06",
              "horse": "Field Of Gold",
              "horse_id": "6088046",
              "race": "Qatar Prix Jean-Luc Lagardere (Group 1) (2yo Colts & Fillies) (New Course) (Turf)",
              "race_id": "878476",
              "course": "Longchamp",
              "course_id": "crs_5486",
              "distance_f": "7",
              "distance_y": "1540",
              "quote": "Fields Of Gold ran a solid race. He was right up there and travelled well but got a little bit caught out by the ground. He's a big, strapping horse and very much a next-year horse - John Gosden, joint-trainer."
            },
            {
              "date": "2024-08-31",
              "horse": "Field Of Gold",
              "horse_id": "6088046",
              "race": "Sky Bet Solario Stakes (Group 3)",
              "race_id": "873829",
              "course": "Sandown",
              "course_id": "crs_1404",
              "distance_f": "7",
              "distance_y": "1540",
              "quote": "Field Of Gold is very exciting. He's always shown great potential at home and it's nice to see him finally deliver it on the track. He's a horse who will stay a mile but he has acceleration and a very good turn of foot. He's a big horse - 16 hands - and is going to be better as he strengthens and will hopefully make a better three-year-old. The Lagard\u00e8re looks the obvious plan at this stage - Barry Mahon, Juddmonte racing manager."
            },
            {
              "date": "2024-07-12",
              "horse": "Field Of Gold",
              "horse_id": "6088046",
              "race": "Weatherbys British EBF Maiden Stakes (Colts & Geldings)",
              "race_id": "870492",
              "course": "Newmarket (July)",
              "course_id": "crs_4524",
              "distance_f": "7",
              "distance_y": "1540",
              "quote": "Field Of Gold has taken a big step forward, albeit he probably ran in a nice race at Doncaster. He was slowly away that day but he was quick today and I was just trying to get a lead for as long as I could. We hit the front a long way out but he knew his job today and he's got a huge stride and plenty of scope. He really galloped out and he's no doubt going to stay a mile - Kieran Shoemark, jockey."
            }
          ],
