          "comment": "French 2,000 Guineas success took his record over 1m to 2-2; one of the main contenders",
          "spotlight": "Ballydoyle colt whose record is 6-8; he is 2-2 over 1m, having won the Breeders' Cup Juvenile Turf (by a neck) on firm ground last November and the French 2,000 Guineas (by a head) on good ground last month; ties in closely with Field Of Gold on one piece of 2yo form; could well have even more to offer at this distance and is one of the main contenders, contributing to a gripping clash of Guineas winners; trainer has landed this prize nine times.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-05-11",
              "horse": "Henri Matisse",
              "horse_id": "58956115",
              "race": "Emirates Poule d'Essai des Poulains (Group 1) (3yo Colts) (Grande Course) (Turf)",
              "race_id": "895463",
              "course": "Longchamp",
              "course_id": "crs_5486",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "Henri Matisse doesn't like to be in front too long and it was a nice even pace. We were hoping it would be like that because he was going to be ridden back. When the pace is usually strong and even, if you have the best horse you have a chance. I'm never confident, I'm always hopeful. Sometimes it works and sometimes it doesn't, but Ryan [Moore] gave him a brilliant ride. I think he could be a miler. We think he's going to be a St James's Palace horse, but the lads will decide that - Aidan O'Brien, trainer."
            },
            {
              "date": "2025-03-30",
              "horse": "Henri Matisse",
              "horse_id": "58956115",
              "race": "Ballylinch Stud \"Red Rocks\" Stakes (Group 3) (Colts & Geldings)",
              "race_id": "891404",
              "course": "Leopardstown",
              "course_id": "crs_4862",
              "distance_f": "7",
              "distance_y": "1570",
              "quote": "Henri Matisse wants to get there late and when he gets there, he waits. He did well because it was a good gallop and he's going to improve fitness-wise. You would have to be happy with him. They went a good gallop and Ryan [Moore, jockey] said he'd definitely be more comfortable going up to a mile. He's obviously very smart and does quicken very well. He'll improve plenty - Aidan O'Brien, trainer."
            },
            {
              "date": "2024-11-02",
              "horse": "Henri Matisse",
              "horse_id": "58956115",
              "race": "Prevagen Breeders' Cup Juvenile Turf (Grade 1) (2yo Colts, Geldings & Ridglings) (Turf)",
              "race_id": "880434",
              "course": "Del Mar",
              "course_id": "crs_11544",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "I said to Aidan beforehand I felt Henri Matisse was by far the best horse in the race. He just travelled into it and I was wide on the bend, but he took me there very comfortably. He won without even knowing he was in the race - Ryan Moore, jockey."
            },
            {
              "date": "2024-08-24",
              "horse": "Henri Matisse",
              "horse_id": "58956115",
              "race": "Coolmore Stud Wootton Bassett Irish EBF Futurity Stakes (Group 2)",
              "race_id": "873240",
              "course": "Curragh",
              "course_id": "crs_4628",
              "distance_f": "7",
              "distance_y": "1540",
              "quote": "Henri Matisse is a lazy horse and he quickens. He was doing that over six and to show that over seven is a good sign. The National Stakes is the plan - Aidan O'Brien, trainer."
            },
            {
              "date": "2024-06-30",
              "horse": "Henri Matisse",
              "horse_id": "58956115",
              "race": "GAIN Railway Stakes (Group 2)",
              "race_id": "869603",
              "course": "Curragh",
              "course_id": "crs_4628",
              "distance_f": "6",
              "distance_y": "1320",
              "quote": "We thought Henri Matisse was a bit too babyish to go to Ascot and Wayne [Lordan, jockey] said he was still babyish there today, but that he will love going up to seven. We will see what we have for the Phoenix Stakes and we will see if we go up to seven next time. He's a lovely horse, though, he tries very hard and he has an unbelievable pedigree. That was my fault [when asked if he was surprised Moore had chosen Tunbridge Wells]. I thought he was a bit more forward and a bit hardier. It was hard to assess Henri Matisse after the first day. He made hard work of it and I put him on the wrong one. I would say the winner is a National Stakes horse. If he was to go again before that it would be the Phoenix Stakes or the Futurity. We haven't really leaned on the colts yet. Hopefully from here on they will really start arriving - Aidan O'Brien, trainer."
            },
            {
              "date": "2024-05-25",
              "horse": "Henri Matisse",
              "horse_id": "58956115",
              "race": "Tally Ho Stud Irish EBF (C & G) Maiden",
              "race_id": "869000",
              "course": "Curragh",
              "course_id": "crs_4628",
              "distance_f": "6",
              "distance_y": "1320",
              "quote": "Henri Matisse will improve a lot mentally. He's a lovely horse. He was very babyish and if he was going to go to Ascot he would need another run - Aidan O'Brien, trainer"
            }
          ],
          "stable_tour": [
            {
              "horse": "Henri Matisse",
              "horse_id": "58956115",
              "quote": "He's a very classy colt. We were delighted with the way he won the French Guineas and the season has gone lovely for him so far. The plan all along was Leopardstown, followed by Longchamp and then on to Ascot for this, so it's all gone the way we hoped so far. He's been very good since the French Guineas. Everything has gone well. 13-06-25"
            }
          ],
