          "comment": "Progressive until coming up well short in the Irish 2,000 Guineas; needs to do better",
          "spotlight": "Has raced exclusively at the Curragh, most recently coming up well short in the Irish 2,000 Guineas behind two of today's rivals; progressive otherwise and comfortably bagged Listed honours the time before; may do better still but needs to prove he's Group 1 class and Henri Matisse is the stable's chief contender.",
