          "comment": "Won last year's Coventry; just over 5l behind Field Of Gold in the Irish 2,000 Guineas",
          "spotlight": "Recorded an 80-1 success in the Coventry here last year; finished in front of Field Of Gold on the Arc card but failed to confirm the placings in the Irish 2,000 Guineas most recently, coming home just over 5l behind that improving opponent; remains a very useful and consistent sort (form figures read 3212224) but needs a personal best to grab further Royal Ascot glory.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-04-12",
              "horse": "Rashabar",
              "horse_id": "5829365",
              "race": "Watership Down Stud Too Darn Hot Greenham Stakes (Group 3) (Colts & Geldings)",
              "race_id": "890340",
              "course": "Newbury",
              "course_id": "crs_936",
              "distance_f": "7",
              "distance_y": "1540",
              "quote": "I think Rashabar needed the run a little bit. Sean said he was doing all the things he wouldn't have necessarily wanted to do. There was no real pace around us so we had to get on and go forward. - Brian Meehan, trainer."
            },
            {
              "date": "2024-08-18",
              "horse": "Rashabar",
              "horse_id": "5829365",
              "race": "Sumbe Prix Morny (Group 1) (2yo Colts & Fillies) (Straight Course) (Turf)",
              "race_id": "875119",
              "course": "Deauville",
              "course_id": "crs_5356",
              "distance_f": "6",
              "distance_y": "1320",
              "quote": "No disrespect to the winner, you can never say anything like that, but if we'd had the rail I think Rashabar would have won. It was a really good, solid run and the horse is progressing, as it's one of the toughest Prix Mornys I've seen in a number of years. I've won the race twice and this horse is better [than Bad As I Wanna Be and Arcano]. What I really want to do is take him to the Breeders' Cup. I think he'll travel well and we'll work from that - Brian Meehan, trainer."
            },
            {
              "date": "2024-06-18",
              "horse": "Rashabar",
              "horse_id": "5829365",
              "race": "Coventry Stakes (Group 2)",
              "race_id": "869179",
              "course": "Ascot",
              "course_id": "crs_52",
              "distance_f": "6",
              "distance_y": "1320",
              "quote": "Rashabar is a lovely horse. Chester was a little disappointing but he missed the break and I think without that he'd have won. The form has worked out well, he'd been training so well at home and the team has done a tremendous job - Brian Meehan, trainer."
            }
          ],
