          "prev_trainers": [],
          "prev_owners": [],
          "comment": "Held on by half a length from Field Of Gold in the 2,000 Guineas; improving sharply",
          "spotlight": "Justify colt who was a 2,300,000euros breeze-up purchase as a 2yo; raced only on good/firmer and was a late withdrawal from the Derby this month as the surface was deemed not fast enough; record of 3-4 includes two emphatic wins; held on by half a length from Field Of Gold in the 2,000 Guineas most recently, having got first run on that rival; improving sharply and, with his ceiling probably not yet reached, commands major respect in the rematch.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-05-03",
              "horse": "Ruling Court",
              "horse_id": "6215363",
              "race": "Betfred 2000 Guineas Stakes (Group 1) (No Geldings)",
              "race_id": "888179",
              "course": "Newmarket",
              "course_id": "crs_988",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "It was a hard choice for William but he saw it right in respect of the fact he thought Ruling Court was going to see the mile out and that's what he did. He outstayed them, I felt. People are obviously going to ask about him being the only horse we've entered in the Derby but most importantly we're going to enjoy today and let the dust settle and try and formulate a plan as to whether we stick to that Derby route. I'd be confident that we will do, hopefully, but they're the kind of decisions that we'll make collectively. When you watched them walk round the paddock he's got the High Chaparral (damsire), he's got that sort of length to him that you can see him as a Derby horse and that's what we had our minds on during the course of the winter - Charlie Appleby, trainer."
            },
            {
              "date": "2025-03-01",
              "horse": "Ruling Court",
              "horse_id": "6215363",
              "race": "Jumeirah 2000 Guineas Sponsored By Emirates Holidays (Listed Race) (Turf)",
              "race_id": "889696",
              "course": "Meydan",
              "course_id": "crs_32006",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "In some ways I was quite pleased that Ruling Court got beaten [in the Acomb at York] because that meant we didn't force him to do more than he was ready for. I'm very lucky in that I can put these horses away and allow them to develop. I think he'll continue to develop and we will go back to Europe with a sharper model. I never want to get too excited in the immediate aftermath, but we anticipated him being a ten furlong horse, so whether we got to the Dante or take in the Guineas on route, we'll see - Charlie Appleby, trainer."
            },
            {
              "date": "2024-08-21",
              "horse": "Ruling Court",
              "horse_id": "6215363",
              "race": "Tattersalls Acomb Stakes (Group 3) (IRE Incentive Race)",
              "race_id": "872986",
              "course": "York",
              "course_id": "crs_2782",
              "distance_f": "7",
              "distance_y": "1540",
              "quote": "Ruling Court hasn't totally disgraced himself but, at face value, he was disappointing. He travelled into it quite well but then flattened out. It might turn out he was beaten by a better horse - Alex Merriam, assistant trainer."
            },
            {
              "date": "2024-07-25",
              "horse": "Ruling Court",
              "horse_id": "6215363",
              "race": "Martin Densham & Peter Deal Memorial British EBF Maiden Stakes (GBB Race)",
              "race_id": "871347",
              "course": "Sandown",
              "course_id": "crs_1404",
              "distance_f": "7",
              "distance_y": "1540",
              "quote": "Ruling Court didn't jump all that well, which you can forgive on his first start. It was a smooth performance and hopefully he can progress from here. I passed a load of horses quite quickly and got there sooner than I expected but it's always hard to read with horses running for the first time. He's shown a good level of form at home and has brought it to the track. He's got plenty of pace so seven furlongs seems like his optimum trip for now but he should get a mile whenever he needs to - William Buick, jockey."
            }
          ],
