          "comment": "1st and 3rd in 2m5f Queen Alexandras here; lacklustre in Chester Cup; tongue-tie goes on",
          "spotlight": "Won 2m5f Queen Alexandra here in 2023 (third in it last year, again on good to firm) and 2m Curragh Group 3 last November; also effective in top, big-field handicaps but put up a very lacklustre display in the Chester Cup on latest outing, admittedly from a wide draw; competitive if back on song with tongue tied first time.",
          "medical": [],
          "quotes": [
            {
              "date": "2024-11-03",
              "horse": "Dawn Rising",
              "horse_id": "2394610",
              "race": "Comer Group International Loughbrown Stakes (Group 3)",
              "race_id": "879372",
              "course": "Curragh",
              "course_id": "crs_4628",
              "distance_f": "16.5",
              "distance_y": "3591",
              "quote": "Dawn Rising came on the bridle with me from about halfway and he was loving it. I was able to mooch away down the centre in the straight. It took him a while to get to Gavin but he was finding plenty for me and I knew I was always going to get there - Dylan Browne McMonagle, rider"
            },
            {
              "date": "2023-06-24",
              "horse": "Dawn Rising",
              "horse_id": "2394610",
              "race": "Queen Alexandra Stakes (Conditions Race)",
              "race_id": "841954",
              "course": "Ascot",
              "course_id": "crs_52",
              "distance_f": "21.5",
              "distance_y": "4763",
              "quote": "Joseph had Dawn Rising beautifully prepared for today. He has been jumping and won a graded race over jumps during the winter, and today he just got himself into a nice spot and I just gradually built along. I hadn't really asked him for everything and he was always finding plenty. Joseph's horses can do that - Ryan Moore, rider, speaking to ITV Racing."
            },
            {
              "date": "2022-09-23",
              "horse": "Dawn Rising",
              "horse_id": "2394610",
              "race": "John J. Galvin Maiden Hurdle",
              "race_id": "822083",
              "course": "Listowel",
              "course_id": "crs_4940",
              "distance_f": "20",
              "distance_y": "4400",
              "quote": "Dawn Rising learned a bit from Galway and came on plenty for the run. It was a good performance. He bumped into a good horse in Galway but came forward plenty. He's taken to hurdling well. We'll go down the novice route I'd imagine and see how we go - Frank Berry, racing manager to owner JP McManus."
            },
            {
              "date": "2020-06-29",
              "horse": "Dawn Rising",
              "horse_id": "2394610",
              "race": "Irish Stallion Farms EBF Maiden",
              "race_id": "761340",
              "course": "Limerick",
              "course_id": "crs_4888",
              "distance_f": "12",
              "distance_y": "2640",
              "quote": "He's a lovely, big, staying horse who had a very good run at the Curragh the last day. He was very idle in front and I know we won by 12 lengths, but you never know when there's something coming from behind you and the way he was rolling around, I just wanted to keep the revs up. He won with plenty in hand at the end. He looked at the stalls in the straight, they were pulled in and he copped them and ran out in the middle - Wayne Lordan, rider of Dawn Rising"
            }
          ],
          "stable_tour": [
            {
              "horse": "Dawn Rising",
              "horse_id": "2394610",
              "quote": "He needs to find his form again but I think it usually takes him a few runs, so hopefully he might bounce back at Ascot.  13-06-25"
            },
            {
              "horse": "Dawn Rising",
              "horse_id": "2394610",
              "quote": "He had a nice run at Leopardstown in the Saval Beg and wasn't beaten far, so hopefully he'll run a nice race in the Queen Alexandra Stakes. 16-06-23"
            }
          ],
