          "comment": "Raced freely upped to 1m6f latest but also stuck to his task well to give hope for 2m+",
          "spotlight": "Third in the 1m4f King Edward VII at this meeting two years ago was the pick of his five runs in Group contests; handicaps on last three outings, racing a bit freely when always-prominent fourth of ten at Newmarket (good to firm) last time on step up to 1m6f but he also stuck to his task very well to give hope for 2m+; 7lb claimer is recruited.",
          "medical": [],
          "quotes": [
            {
              "date": "2023-06-03",
              "horse": "Artistic Star",
              "horse_id": "4628833",
              "race": "Betfred Derby (Group 1) (British Champions Series) (No Geldings)",
              "race_id": "800632",
              "course": "Epsom",
              "course_id": "crs_442",
              "distance_f": "12",
              "distance_y": "2646",
              "quote": "To see Artistic Star finish off the way he did was really pleasing as it showed he can compete at this level on a conventional track. He will stay a mile six and we can do that later on in the year, but for now we will stay at a mile and a half - Rob Hornby, rider."
            },
            {
              "date": "2023-05-16",
              "horse": "Artistic Star",
              "horse_id": "4628833",
              "race": "Darley British EBF Novice Stakes (GBB Race)",
              "race_id": "838242",
              "course": "Sandown",
              "course_id": "crs_1404",
              "distance_f": "10",
              "distance_y": "2189",
              "quote": "Artistic Star is a smashing horse. He is May 27th foal and he has only just been ready for this now, he is still a horse in the making I feel. We wanted to go to Lingfield (Derby Trial) and that opportunity was taken away from us so this was a really good spot for him. Jessie Harrington had the full sister (Forbearance) and she was adamant she needed fast ground and so if we did get into our heat of summer the King Edward VII might seem like a target. I'd be a little bit concerned it is only two and a half weeks until Epsom and he might just bounce - Ralph Beckett, trainer."
            }
          ],
