          "comment": "Went close in this (good to firm) last term off 2lb lower; return to form is not ruled out",
          "spotlight": "Went close in this race (good to firm) last term off 2lb lower; has since come up short with higher marks and higher grades; perhaps forgiven latest start, in the Chester Cup, and a return to form is not ruled out.",
          "medical": [],
          "quotes": [
            {
              "date": "2024-05-25",
              "horse": "Divine Comedy",
              "horse_id": "3505932",
              "race": "Betfred Nifty 50 Hell Nook Handicap",
              "race_id": "866773",
              "course": "Haydock",
              "course_id": "crs_598",
              "distance_f": "16",
              "distance_y": "3566",
              "quote": "I hadn't thought beyond today because two miles on this ground is a very different kettle of fish to two miles at Kempton but Divine Comedy loved the ground and the trip. The Ascot Stakes came to mind, black type will come into it at some point and the handicapper will have his say. Something like the Doncaster Cup could be a race for her down the line - Harry Eustace, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Divine Comedy",
              "horse_id": "3505932",
              "quote": "She's been an absolute star but only once this year has she had her ground. She's in the Old Borough Cup and her main aim is the Irish Cesarewitch - on soft ground she could be very effective there. We thought about the Doncaster Cup but that's a bit too close to the Irish Cesarewitch. 11-09-24"
            },
            {
              "horse": "Divine Comedy",
              "horse_id": "3505932",
              "quote": "She didn't run as a juvenile and has had three unplaced runs this season. I thought I would start off in modest company but the three maidens we have run in, at Wetherby, Newmarket and Yarmouth, proved to be hot races. She has been given a mark of 66, which I think is fair, and she'll be well suited to 1m2f and 1m4f. She's a big filly with scope to progress through the second half of the season. She'll act on quicker ground but would prefer some juice. 30-06-21"
            }
          ],
