          "comment": "Ran well on return but not since; latest again failed to prove he stays 2m; headgear today",
          "spotlight": "Handicap hat-trick last summer (final leg at Glorious Goodwood) and he ran well in Listed event on return; not in the best of form since, though, and latest start again failed to prove he stays 2m; headgear enlisted.",
          "medical": [],
          "quotes": [
            {
              "date": "2024-08-03",
              "horse": "Align The Stars",
              "horse_id": "5237856",
              "race": "Coral Summer Handicap",
              "race_id": "872008",
              "course": "Goodwood",
              "course_id": "crs_546",
              "distance_f": "14",
              "distance_y": "3080",
              "quote": "Jason Hart galloped Align The Stars in July last year before he'd ever run and said he'll win the Ascot Gold Cup, and we're still bang on track.   He still hasn't really raced over a relentless mile and six furlongs and I think an emphasis on stamina in the St Leger is really going to take him to the next level. It will take another step up for him to be competitive, but I have enough faith in him that it's a realistic aim.  I think back to Subjectivist at the same part of his career and he went to the Leger and it was too sharp a test for him, but then he won a Group 1 in the Prix Royal Oak as a three-year-old - Charlie Johnston, trainer."
            },
            {
              "date": "2024-07-06",
              "horse": "Align The Stars",
              "horse_id": "5237856",
              "race": "bet365 Handicap",
              "race_id": "870348",
              "course": "Haydock",
              "course_id": "crs_598",
              "distance_f": "14",
              "distance_y": "3081",
              "quote": "Align The Stars is a huge horse who's bred to be top-class. We probably ran him more than we wanted to last year, chasing his Book 1 bonus. I've always hoped he would be a Group horse in time and I've not seen anything today that doesn't give me that confidence. If he went to Goodwood he'd have to come back to a mile and a half and Tony [Farmer, owner] is a big York man, so the Melrose has been on the radar for a long time - Charlie Johnston, trainer."
            }
          ],
