          "comment": "Reverted to the Flat with two 2nds and two wins; looks a live prospect for this race too",
          "spotlight": "Sole attempt on good to firm was debut; fairly useful hurdler who has reverted to the Flat with two seconds and two wins; the wins came in handicaps at Dundalk (2m, AW; easily at 2-5) and Cork (1m4f, good; hard fought) and he looks a live prospect for this race despite his speedy pedigree.",
          "medical": [],
          "quotes": [],
          "stable_tour": [
            {
              "horse": "Ascending",
              "horse_id": "3526578",
              "quote": "He's been running well on the Flat and we'll probably give him one more run at Dundalk and then maybe go for a maiden hurdle at Christmas. His maiden hurdle form is good and hopefully he can win one. 18-11-24"
            },
            {
              "horse": "Ascending",
              "horse_id": "3526578",
              "quote": "He came to us from Clive Cox having won a Goodwood mile handicap in the summer. His first run over hurdles gave us plenty of encouragement when a half-length second to Tekao at Leopardstown over Christmas. His next run was in the Grade 1 Spring Juvenile Hurdle at the Dublin Racing Festival and he ran well enough to be fourth behind Gala Marceau. He has an entry in the Triumph Hurdle and we'll see how he is much nearer the race before deciding whether to send him over for that. 01-03-23"
            }
          ],
