          "comment": "Won Flat return; up 7lb and into a much stronger race but could have plenty more to offer",
          "spotlight": "Fairly useful hurdler; 1-3 on the Flat in France early in 2023 and returned to this sphere with a front-running win in six-runner handicap at Newmarket (1m6f, good to firm) one month ago, going clear about 4f out and staying clear; up 7lb and into a much stronger race but he could have plenty more to offer.",
          "medical": [],
          "quotes": [
            {
              "date": "2023-12-09",
              "horse": "Liari",
              "horse_id": "5015325",
              "race": "Boylesports Daily Money Back 2nd Juvenile Hurdle (Listed Race) (GBB Race)",
              "race_id": "854213",
              "course": "Aintree",
              "course_id": "crs_832",
              "distance_f": "17",
              "distance_y": "3729",
              "quote": "Liari is a gorgeous horse. He came from France where he did okay on the Flat. He's improved since his last run and will keep improving. He'll have an entry in the Triumph, but there are plenty of other races in the spring - back here might suit him. He's a lovely horse for the future and needs looking after - Paul Nicholls, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Liari",
              "horse_id": "5015325",
              "quote": "There were some who were disappointed by his first run back at Chepstow, but I'm not one of them. He's a lean individual who you don't want to over-work at home, so I knew he'd need his reappearance but he ran well off top weight. I've always planned to go for the Greatwood Hurdle, so that first outing should bring him on considerably. He lost his unbeaten record last season in the Fred Winter when very unlucky, as a swinging hurdle caught him three out, and he was fortunate not to injure himself. There's a lot more to come from him. 04-11-24"
            },
            {
              "horse": "Liari",
              "horse_id": "5015325",
              "quote": "He's one for the Ascot Stakes on the Tuesday of Royal Ascot. He won well at Newmarket on his stable debut for us and has taken to life with us like a duck to water. He won over 1m6f and we don't know if he'll get the extreme distance at Ascot but he's a huge, great horse and a powerful galloper who hit the line very well at Newmarket, so we'll see. 09-06-25"
            }
          ],
