          "comment": "Lightly raced 5yo; 2m4f interesting and he holds possibilities if latest run is forgiven",
          "spotlight": "Most starts on good ground, unraced on firmer; lightly raced 5yo who had 282 days off before emerging from off the pace to win narrowly at Navan (1m6f) in April; below-form favourite behind Ascending at Cork (1m4f) six weeks ago but going beyond 1m6f for the first time is interesting and he holds possibilities if that latest run is forgiven.",
          "medical": [],
          "quotes": [
            {
              "date": "2024-05-12",
              "horse": "Saturn",
              "horse_id": "4263182",
              "race": "Leopardstown Golf And Driving Range Handicap",
              "race_id": "867778",
              "course": "Leopardstown",
              "course_id": "crs_4862",
              "distance_f": "10",
              "distance_y": "2200",
              "quote": "Saturn was only ready to start off today, it was an inadequate trip and he's only going to be better over 1m4f or 1m6f. The key to him was the ground, we wanted to get him started, the faster the better, he seems to skip off it. He could go for a 1m6f on Guineas' weekend at the Curragh - Shane Foley, jockey, speaking to Racing TV."
            },
            {
              "date": "2023-11-29",
              "horse": "Saturn",
              "horse_id": "4263182",
              "race": "Now Racing Every Wednesday At Dundalk Maiden",
              "race_id": "855624",
              "course": "Dundalk (AW)",
              "course_id": "crs_29588",
              "distance_f": "12",
              "distance_y": "2640",
              "quote": "Saturn had a really good run at the Curragh the first day and we probably ran him on ground that was a little bit too soft for him the second day and Shane (Foley) got off him that day and said don't run him on that ground again and to step him up to 1m4f. We were short of options so we were forced into running him over 1m2f here and he was just caught for a bit of toe inside the last furlong. We sat and waited for this 1m4f maiden and Scott (McCullagh) said he did it very impressively and no problem stepping him up to 1m6f - Katie Harrington, assistant trainer, talking to RTV."
            }
          ],
          "stable_tour": [
            {
              "horse": "Saturn",
              "horse_id": "4263182",
              "quote": "He's been prepared for Ascot since his run at Cork. He made a winning reappearance at Navan over 1m6f, but we dropped him back to a mile and a half at Cork and they went no gallop that day, so he was caught flat-footed. We're really looking forward to seeing how he gets on in one of the staying handicaps. 13-06-25"
            }
          ],
