          "comment": "Strong late challenge won a big-field Flat handicap at Naas (2m, yielding) last autumn",
          "spotlight": "Unraced on firmer than good; fairly useful hurdler (stays 2m6f) on his day in 2024, below form in two festival runs this spring; ran in three big-field Flat handicaps last autumn, back to form when winning with a strong late challenge at Naas (2m, yielding) on third occasion, so he's not entirely ruled out despite an apparently tough British mark.",
          "medical": [],
          "quotes": [
            {
              "date": "2024-10-13",
              "horse": "Comfort Zone",
              "horse_id": "3730969",
              "race": "Colm White Bookmaker Beggar's End Handicap (Premier Handicap)",
              "race_id": "878421",
              "course": "Naas",
              "course_id": "crs_4992",
              "distance_f": "16",
              "distance_y": "3543",
              "quote": "Dylan gave Comfort Zone a lovely ride and it's a lovely race to win. You will probably see him back over hurdles over the winter - Frank Berry, racing manager to JP McManus."
            },
            {
              "date": "2023-01-28",
              "horse": "Comfort Zone",
              "horse_id": "3730969",
              "race": "JCB Triumph Trial Juvenile Hurdle (Grade 2) (Registered As The Finesse) (GBB Race)",
              "race_id": "829565",
              "course": "Cheltenham",
              "course_id": "crs_286",
              "distance_f": "17",
              "distance_y": "3699",
              "quote": "Scriptwriter is probably the best gauge-stick in England so I was happy with the performance. Scriptwriter was a non-runner on the day (at Chepstow) so I suppose this form is a little better. You wouldn't have known. The track probably suited Comfort Zone and riding him like that was a bit more sensible. He definitely deserves his chance at Cheltenham in whatever race. I wouldn't mind riding him anyway - Jonjo O'Neill Jr, jockey."
            },
            {
              "date": "2022-12-27",
              "horse": "Comfort Zone",
              "horse_id": "3730969",
              "race": "Coral Finale Juvenile Hurdle (Grade 2) (GBB Race)",
              "race_id": "827387",
              "course": "Chepstow",
              "course_id": "crs_312",
              "distance_f": "16",
              "distance_y": "3531",
              "quote": "Comfort Zone jumps well and is a good, honest little horse. He's very straightforward and the ground is hard work so that was a good performance. This was a race we thought he could win, that's why he's here and it's some good placing by the trainer. Joseph's good with his decisions - AP McCoy, representing owner JP McManus."
            },
            {
              "date": "2022-11-27",
              "horse": "Comfort Zone",
              "horse_id": "3730969",
              "race": "Bar One Racing 3-Y-O Maiden Hurdle",
              "race_id": "827184",
              "course": "Navan",
              "course_id": "crs_5018",
              "distance_f": "16",
              "distance_y": "3520",
              "quote": "Joseph has a nice team of juveniles and here's another nice one. The main thing was to get Comfort Zone jumping and travelling, to give him a nice introduction today. It was nice that he was able to go on and win impressively the way he did after doing all that. I was always getting there but the thing was not to pull the trigger too soon. It was about timing and it was easy to do that on a lad like him that was doing everything so easily - JJ Slevin, rider."
            }
          ],
          "stable_tour": [
            {
              "horse": "Comfort Zone",
              "horse_id": "3730969",
              "quote": "At the moment we'll be sticking to jumping with him, but we could be looking for a Flat handicap for him somewhere along the line, be it at Galway or one of the nice staying handicaps in the autumn. 23-04-24"
            },
            {
              "horse": "Comfort Zone",
              "horse_id": "3730969",
              "quote": "He had a great season, winning twice at Grade 2 level and he was kept very busy so we were conscious not to overdo him since then. He's in good shape and he could be targeted at some handicap hurdles in the spring. He had a nice break earlier in the year and will have another break after his run at Leopardstown, so he will be back in the spring. 27-11-23"
            }
          ],
