              "course": "Curragh",
              "course_id": "crs_4628",
              "distance_f": "12",
              "distance_y": "2640",
              "quote": "Leinster had a real nice run at Roscommon and had a setback so it was unfortunate he missed the rest of the season. Hopefully he can be a progressive stayer. He looked at Roscommon as if the trip was a bit short for him so we were looking forward to stepping him up and I don't think stamina will be any issue to him going forward. The form of the Roscommon race was strong and he handles soft ground well - Joseph O'Brien, trainer."
