          "comment": "A top juvenile hurdler and his trainer usually picks the right candidates for these races",
          "spotlight": "Trained last year by Ralph Beckett, favourite when below form in the 1m1f Cambridgeshire on final outing (also below form on sole run on good to firm); made his stable/hurdles debut in March, in the Triumph at Cheltenham no less, but belied odds of 100-1 to win by a neck; second at Punchestown in May (despite racing freely) confirmed his high standing in that sphere, so he's a high-profile candidate for this return to Flat, over a very new Flat trip but his trainer usually picks the right ones for these races.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-03-14",
              "horse": "Poniros",
              "horse_id": "5343911",
              "race": "JCB Triumph Hurdle (Grade 1) (GBB Race)",
              "race_id": "883113",
              "course": "Cheltenham",
              "course_id": "crs_286",
              "distance_f": "17",
              "distance_y": "3699",
              "quote": "We bought Poniros in October, schooled him and gave him a break. We said we'd better drag him in from the field and get him ready for Cheltenham, and that's what we did. But I didn't expect any more than a nice run. We had a lot of horses in the race and they all came here with the same plan. I couldn't believe it when I saw him flying through the middle of them. You must remember that he came from the Flat, so he had race experience - that's a huge advantage. I imagine he'll go to Punchestown, and then we'll find something at Royal Ascot, perhaps. He was bought as a dual-purpose horse, and I am hoping in time he might turn into a Melbourne Cup horse - that would be the long-term plan - Willie Mullions, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Poniros",
              "horse_id": "5343911",
              "quote": "He's a lovely horse and I'm hopeful we can step him up in grade at some point. There are races at the Craven and Greenham meetings this week but we've declared for Windsor on Monday. 15-04-24"
            }
          ],
