          "comment": "Won 1m2f Group 3 at Curragh in April but a 5lb penalty for that could leave him vulnerable",
          "spotlight": "Stepped up from his Dubai efforts earlier in year when making all in 1m2f Group 3 at the Curragh (good; first-time cheekpieces) in April; couldn't repeat the form in a Group 2 there six weeks ago and a 5lb penalty for the Group 3 success leaves him vulnerable here.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-04-12",
              "horse": "Galen",
              "horse_id": "5147948",
              "race": "Tote.ie Alleged Stakes (Group 3)",
              "race_id": "891110",
              "course": "Curragh",
              "course_id": "crs_4628",
              "distance_f": "10",
              "distance_y": "2200",
              "quote": "He's always been a good horse and Galen ran well in Dubai a few times where he just didn't get the rub of the green. He obviously had the fitness edge. Dylan didn't think there was much pace and was happy to go to the front and it was a good performance. I think he does enjoy being ridden like that and the cheekpieces helped him concentrate. We'll look at the Mooresbridge Stakes and then possibly the Tattersalls Gold Cup - Joseph O'Brien, trainer"
            },
            {
              "date": "2024-07-15",
              "horse": "Galen",
              "horse_id": "5147948",
              "race": "Irish Stallion Farms EBF Race",
              "race_id": "872557",
              "course": "Killarney",
              "course_id": "crs_4810",
              "distance_f": "8",
              "distance_y": "1780",
              "quote": "We couldn't have been more pleased that that. We jumped and I let Galen swing along, good even fractions the whole way and from the top of the straight I let him stretch. He was strong through line. He's going the right way and only going to get better. The ground was a big help, he's a really good mover - Dylan Browne McMonagle, jockey, speaking to Racing TV"
            },
            {
              "date": "2024-06-29",
              "horse": "Galen",
              "horse_id": "5147948",
              "race": "Molton Brown Irish EBF Median Auction Maiden",
              "race_id": "871662",
              "course": "Curragh",
              "course_id": "crs_4628",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "Galen had a setback after his run here last year, he ran a good race here on his comeback and he came forward since then. I don't think they are his conditions, but I'm delighted that he won well - Joseph O'Brien, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Galen",
              "horse_id": "5147948",
              "quote": "We think the mile and a quarter will suit him and his form this year has been strong, including winning a Group 3 at the Curragh. 13-06-25"
            }
          ],
