          "owner": "Sheikh Mohammed Obaid Al Maktoum",
          "owner_id": "own_221344",
          "prev_trainers": [],
          "prev_owners": [],
          "comment": "Edged out Meydaan in 1m2f Goodwood Listed latest start but 3lb worse off with that one now",
          "spotlight": "Soft-ground Cambridgeshire winner (1m1f) who showed he's equally effective on good ground when edging out Meydaan in 1m2f Goodwood Listed race 25 days ago; meets that rival on 3lb worse terms here and has drawn the outside stall.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-05-23",
              "horse": "Liberty Lane",
              "horse_id": "4175305",
              "race": "BetGoodwin Festival Stakes (Listed Race)",
              "race_id": "893871",
              "course": "Goodwood",
              "course_id": "crs_546",
              "distance_f": "10",
              "distance_y": "2177",
              "quote": "Liberty Lane won the Cambridgeshire off top weight, but this was probably the best performance of his career so far. He's improving and I think he'll stay further than this too. I knew cantering to the start that he'd enjoy this. He travels so well and is a lovely, big horse. We can look forward to the rest of the season now and he can be a keen horse, but at the three-pole I thought I had everything put to bed - Clifford Lee, jockey, speaking to Racing TV."
            },
            {
              "date": "2024-09-28",
              "horse": "Liberty Lane",
              "horse_id": "4175305",
              "race": "bet365 Cambridgeshire (Heritage Handicap)",
              "race_id": "873968",
              "course": "Newmarket",
              "course_id": "crs_988",
              "distance_f": "9",
              "distance_y": "1980",
              "quote": "I was a bit worried at halfway as they looked like they had it on the stands' side, but I had walked the course yesterday and I was convinced that's not where you wanted to be. The ground was 100 per cent the reason Liberty Lane didn't perform in the race last year, as he wants a bit of juice in the ground to be able to get into a rhythm. I ran him in the Dante as a three-year-old and he was always running a bit free as a younger horse but he's always been a good horse - Karl Burke, trainer."
            },
            {
              "date": "2024-05-04",
              "horse": "Liberty Lane",
              "horse_id": "4175305",
              "race": "William Hill Suffolk Stakes (Heritage Handicap)",
              "race_id": "863447",
              "course": "Newmarket",
              "course_id": "crs_988",
              "distance_f": "9",
              "distance_y": "1980",
              "quote": "Liberty Lane was sick after the Lincoln and scoped very dirty. The only reasons I ran him today were because I knew Sheikh Obaid would be here and it was a hundred grand race that we had entered early in. He had been coming back to himself in recent days but I didn't expect that. He's learning to relax in his races now as he was always very keen. Clifford gave him a lovely ride today and he will improve for that - Karl Burke, trainer."
            },
            {
              "date": "2023-09-16",
              "horse": "Liberty Lane",
              "horse_id": "4175305",
              "race": "Hippo Pro 3 Sealant Handicap",
              "race_id": "847663",
              "course": "Doncaster",
              "course_id": "crs_390",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "All Liberty Lane does is gallop. I always thought soft ground and a mile is what he wants - Clifford Lee, jockey."
            },
            {
              "date": "2022-10-05",
              "horse": "Liberty Lane",
              "horse_id": "4175305",
              "race": "British EBF Future Stayers Oath Novice Stakes (Sire And Dam Restricted Race) (GBB Race)",
              "race_id": "820658",
              "course": "Nottingham",
              "course_id": "crs_1040",
              "distance_f": "8.5",
              "distance_y": "1835",
              "quote": "That felt very good, Liberty Lane travelled well throughout and relished the ease in the ground. He's a lovely horse, tries hard and had been working really well at home. He's a big colt but he's so chilled out and relaxes really nicely. Lucy (Burke) has been riding him a lot at home and I'd galloped him a few times; he's progressed really nicely - Clifford Lee, jockey."
            }
          ],
          "stable_tour": [
            {
              "horse": "Liberty Lane",
              "horse_id": "4175305",
              "quote": "He's come out of his win at Goodwood really well and will probably run in the Wolferton if there's a little bit of juice in the ground. 12-06-25"
            },
            {
              "horse": "Liberty Lane",
              "horse_id": "4175305",
              "quote": "A beautiful colt and, after winning his only start last year at Nottingham by five lengths, we put him away for the winter. On his return at Newmarket earlier this month I thought he would take some beating, but it could be that trying to concede 7lb to Waipiro will look to have been some task as I thought the winner looked smart on the day. I had wanted to run him at Newbury later that week as I felt the course would suit him more but I saw Sheikh Obaid had two other entries so I opted for Newmarket, although I know the Sheikh would not have minded where I ran him. We will look for a Derby trial if we can get some ground on the easy side. 07-05-23"
            }
          ],
