          "owner": "Godolphin",
          "owner_id": "own_199380",
          "prev_trainers": [],
          "prev_owners": [],
          "comment": "Very good AW record (Listed win in April) but possibly not as good on turf; 3lb penalty",
          "spotlight": "Added to his very good AW record with a stylish win in a Listed race at Kempton (1m2f) in April but he wasn't in quite the same form when fourth (Phantom Flight third) in the Brigadier Gerard at Sandown since and there are doubts as to whether he's still as effective on turf as AW; also has a 3lb penalty for the Kempton win.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-04-21",
              "horse": "Military Order",
              "horse_id": "4586320",
              "race": "Virgin Bet Daily Price Boosts Magnolia Stakes (Listed Race)",
              "race_id": "891786",
              "course": "Kempton (AW)",
              "course_id": "crs_28054",
              "distance_f": "10",
              "distance_y": "2199",
              "quote": "Military Order is a big horse who's probably taken a bit of time to come into his own. It's the first time I've been on him for a while and he feels a much stronger version of himself. He'll improve for this as Kempton is one of the sharpest tracks he's been round. It can be tricky when you're out of position here, but he travelled supremely well - William Buick, jockey."
            },
            {
              "date": "2024-02-24",
              "horse": "Military Order",
              "horse_id": "4586320",
              "race": "BetUK Winter Derby Stakes (Group 3)",
              "race_id": "857545",
              "course": "Southwell (AW)",
              "course_id": "crs_10244",
              "distance_f": "11",
              "distance_y": "2443",
              "quote": "Military Order was a bit cute last time, so Charlie [Appleby, trainer] said to run him quiet off the bend and he came back strong. It's a nice prize to win and it's nice that he's stepped up on his form in the trial. He's always been a talented horse and could go back to a mile and a half easily - Danny Tudhope, jockey."
            },
            {
              "date": "2023-06-03",
              "horse": "Military Order",
              "horse_id": "4586320",
              "race": "Betfred Derby (Group 1) (British Champions Series) (No Geldings)",
              "race_id": "800632",
              "course": "Epsom",
              "course_id": "crs_442",
              "distance_f": "12",
              "distance_y": "2646",
              "quote": "Military Order just didn't run his race. I suppose that can happen sometimes. I thought I would follow Frankie through. He was relaxed but all in all it was a bit disappointing. You find when they are not travelling or running a race it is normally a case of them not handling the track - William Buick, rider."
            },
            {
              "date": "2023-05-13",
              "horse": "Military Order",
              "horse_id": "4586320",
              "race": "Fitzdares Lingfield Derby Trial Stakes (Listed Race) (Colts & Geldings)",
              "race_id": "841156",
              "course": "Lingfield (AW)",
              "course_id": "crs_10218",
              "distance_f": "12",
              "distance_y": "2640",
              "quote": "Military Order had to overcome a race around a track that at this stage of his career, doesn't really play to his strengths. As soon as I was in position he was there for me, he's a very balanced horse. He's come through this test great and did everything right. It's another tick in the box for him - William Buick, rider, speaking on ITV."
            },
            {
              "date": "2023-04-21",
              "horse": "Military Order",
              "horse_id": "4586320",
              "race": "Darley Novice Stakes (GBB Race)",
              "race_id": "835730",
              "course": "Newbury",
              "course_id": "crs_936",
              "distance_f": "10",
              "distance_y": "2200",
              "quote": "We could think about the Lingfield Derby Trial for Military Order and I don't think he wants that ground, but he's a nice horse. He's a similar stamp to his brother [Adayar]. He's big horse, so I don't think he'd want rock-hard ground, but it's rare big races are run on it - Alex Merriam, assistant trainer"
            },
            {
              "date": "2022-10-19",
              "horse": "Military Order",
              "horse_id": "4586320",
              "race": "British Stallion Studs EBF Future Stayers Novice Stakes (Sire And Dam-Restricted Race) (GBB Race)",
              "race_id": "821639",
              "course": "Newmarket",
              "course_id": "crs_988",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "Going up from the seven furlongs to the mile was going to put us where we needed to be. Staying is going to be Military Order's forte. For a horse who got into a bit of a race for a moment he soon put it to bed when he hit the rising ground. I think he is still a big baby, he still hasn't got a clue to be honest. He is a typical horse that finds life very easy at home. He goes up and down the hill there and finds it very easy. I feel there is plenty more improvement to come. He has got the same profile as Adayar now as he finished fourth first time then won - Charlie Appleby, trainer."
            }
          ],
