          "comment": "Really smart handicap performance when scoring easily at Epsom recently; not discounted",
          "spotlight": "Placed at Group 3 and Listed level last year; recorded a really smart handicap performance when making his second start for Richard Fahey a winning one on reappearance at the recent Epsom Derby meeting (1m2f, good to soft), pulling 4l clear; a fairly quick turnaround is a slight worry after such a big effort but he's bang there on form; has raced only on going softer than good.",
