              "course_id": "crs_442",
              "distance_f": "10",
              "distance_y": "2217",
              "quote": "We're pleased with Ecureuil Secret and he was always going to get better when he gets older. When you look at his price you start to question whether you're getting it wrong. The plan was to come here and then go to the Wolferton Stakes. He's a huge horse and he's only going to get better with age - Richard Fahey, trainer."
