          "comment": "Only fifth in Group 3 on reappearance but should be sharper now and yard does well in this",
          "spotlight": "Enjoyed a good 2024, including a win in valuable John Smith's Cup at York (1m2f, good to soft); showed he can mix it outside handicaps when second in 1m2f Listed race at Ayr (good to firm) last autumn; went without regular hood (back on now) when behind a couple of today's rivals in the Group 3 Brigadier Gerard on his reappearance at Sandown (1m2f, good) 19 days ago; likely to be sharper now and his yard has won this twice in recent years; a must for the shortlist from a handy draw.",
          "medical": [],
          "quotes": [
            {
              "date": "2024-07-13",
              "horse": "Enfjaar",
              "horse_id": "4607023",
              "race": "John Smith's Cup Handicap (Heritage Handicap)",
              "race_id": "868214",
              "course": "York",
              "course_id": "crs_2782",
              "distance_f": "10.5",
              "distance_y": "2256",
              "quote": "Enfjaar had bone bruising among some other things last year, but Jack rode him in work last week and he looked good. This was a tough race, though, but we won it two years ago with a horse who went and won a Group 1. I'm not saying this fella will, but I hope he will! We'll reassess and see where they put him, but he'll probably be out of handicaps and into Group races now. There's lots of lovely races in Britain and abroad. He's exciting - Richard Hills, owners' representative."
            }
          ],
          "stable_tour": [
            {
              "horse": "Enfjaar",
              "horse_id": "4607023",
              "quote": "The Wolferton has always been his early-season plan, so I wasn't in any way, shape or form disappointed with his run in the Brigadier Gerard. He ran a bit fresh and just got tired when he came to challenge. He'll improve a lot for the run. He wouldn't want the ground heavy but would be fine on anything else and I like this race for him.   09-06-25"
            }
          ],
