          "comment": "Smart, including 2nd at 2024 Royal Ascot; too free in blinkers latest and no headgear now",
          "spotlight": "Runner-up in Group 3 Hampton Court at last year's Royal meeting and improved again when second in York Group 2 on his next start (both 1m2f, good to firm); his progress has stalled since but the fitting of blinkers backfired (raced too freely) when sixth in a 1m4f Newbury Group 3 last month (first run since gelded) and he showed enough when fourth in Qatar prior to that to think he retains his ability; no headgear now.",
          "medical": [],
          "quotes": [
            {
              "date": "2024-08-21",
              "horse": "King's Gambit",
              "horse_id": "5193455",
              "race": "Sky Bet Great Voltigeur Stakes (Group 2) (Colts & Geldings)",
              "race_id": "870564",
              "course": "York",
              "course_id": "crs_2782",
              "distance_f": "12",
              "distance_y": "2608",
              "quote": "I thought King's Gambit ran a lovely race. William [Buick, jockey] just thought he stays a mile and a half but that was more like a mile and six the way they rode it. He was just slightly running on empty at the line. He's a ten or 12-furlong horse but 12 in less extreme circumstances - Harry Charlton, trainer."
            },
            {
              "date": "2024-06-20",
              "horse": "King's Gambit",
              "horse_id": "5193455",
              "race": "Hampton Court Stakes (Group 3)",
              "race_id": "869187",
              "course": "Ascot",
              "course_id": "crs_52",
              "distance_f": "10",
              "distance_y": "2192",
              "quote": "It looked like a disaster from furlong one - we were in the worst possible position on this round course, and King's Gambit has run monstrously well to get anywhere near them. You can see how good he is, and we'll enjoy him down the line - Harry Charlton, trainer."
            },
            {
              "date": "2024-05-18",
              "horse": "King's Gambit",
              "horse_id": "5193455",
              "race": "Trade Nation London Gold Cup Handicap (Heritage Handicap)",
              "race_id": "865709",
              "course": "Newbury",
              "course_id": "crs_936",
              "distance_f": "10",
              "distance_y": "2200",
              "quote": "When you do that off a handicap mark of 93, it's hard to argue that you're not pretty good. I'd say around 80 per cent of the previous winners of this race are stallions now and it's a proper race. We always thought King's Gambit was a proper horse but he was exceptionally raw last season. William said the Hampton Court would be his sort of race and that's where Time Test went after this - Harry Charlton, trainer."
            },
            {
              "date": "2023-08-18",
              "horse": "King's Gambit",
              "horse_id": "5193455",
              "race": "Benny Hutchins Memorial EBF Maiden Stakes (GBB Race) (IRE Incentive Race)",
              "race_id": "845830",
              "course": "Newbury",
              "course_id": "crs_936",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "The first time King's Gambit ran, he went up in the air and missed the break. I thought he'd step forward. I wasn't sure about the ground, but I guess some Saxon Warriors go on the soft. He's always been a nice horse. I was a bit disappointed first time and I wasn't surprised this time - I think the only surprising thing was the price. We won't be in a rush because he's immature physically and mentally, and he's not going to jump up a huge grade next time, but Trevor said he couldn't pull him up, which is a good sign - Roger Charlton, joint-trainer."
            }
          ],
