          "comment": "Still smart as a 9yo but this trip is possibly on the short side for him these days",
          "spotlight": "Won a 1m4f handicap here (good) last summer and showed he's still capable of smart form as a 9yo when reaching the frame in Group 2s over 1m4f and 2m at Meydan this spring; down the field in a Longchamp Group 1 over just short of 2m since; back down significantly in trip; others are more obvious.",
          "medical": [],
          "quotes": [
            {
              "date": "2022-07-01",
              "horse": "Passion And Glory",
              "horse_id": "2349924",
              "race": "Davies Insurance Services Gala Stakes (Listed Race)",
              "race_id": "813890",
              "course": "Sandown",
              "course_id": "crs_1404",
              "distance_f": "10",
              "distance_y": "2189",
              "quote": "Passion And Glory was down in trip and Saeed thought the ground might be a bit quick, but he handled it fine. It's maybe on the quick side of good and he jumped well and travelled well, so I let him use himself with this being his minimum trip. I didn't know where he was fitness-wise, but he hit the line well enough and had a good blow after. I did think something could tap him for toe, so that's why I took him on early enough before I got headed. I was a bit worried I committed too soon, not knowing his fitness levels, but he got away with it today - Hollie Doyle, jockey."
            },
            {
              "date": "2021-07-30",
              "horse": "Passion And Glory",
              "horse_id": "2349924",
              "race": "l'Ormarins Queen's Plate Glorious Stakes (Group 3)",
              "race_id": "788183",
              "course": "Goodwood",
              "course_id": "crs_546",
              "distance_f": "12",
              "distance_y": "2638",
              "quote": "That's the best sort of ground for Passion And Glory and he handled it really well. I'm now thinking of taking him to Germany for the Group 1 at Baden-Baden. I've always liked the horse but tiny problems have kept stopping him - Saeed Bin Suroor, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Passion And Glory",
              "horse_id": "2349924",
              "quote": "He had a very good season in Britain last year, winning three consecutive races before finishing third in Group 1 company in Germany behind subsequent Arc winner Torquator Tasso. He had his first start of this year on January 14 in the Listed Dubai Racing Club Classic over 1m4f, will have improved for the race and will have various entries from 1m1f to 1m4f in Dubai. A trip to Saudi could also be a possibility for the Red Sea Turf Handicap, for which he's received an invitation. 26-01-22"
            }
          ],
