          "comment": "Off since third in this last year; has gone well fresh before; cheekpieces now; in the mix",
          "spotlight": "Finished fourth in the Group 3 Hampton Court and third (same owner's Haunted Dream second) in this race at the last two Royal Ascots, both on good to firm; absent since the latter but has gone well fresh before and is yet another who has to enter calculations; wears first-time cheekpieces.",
