              "quote": "It's hard work on that ground and it's tough to get through that on the first run of the season. Torito got tired in the last half furlong but should come on for that. He might want stepping up in trip and to be ridden a bit more patiently. I think he'll be better on better ground - Robert Havlin, jockey."
