          "owner": "Al Shaqab Racing",
          "owner_id": "own_869464",
          "prev_trainers": [],
          "prev_owners": [],
          "comment": "Won 1m handicap at 2024 Royal Ascot; Listed winner last autumn but well held on return",
          "spotlight": "Won Kensington Palace handicap at last year's Royal Ascot (1m, good to firm) and added a Listed race at Saint-Cloud (1m2f, very soft) in the autumn; weakened into a well-held sixth in 1m2f York Group 2 on reappearance in May but she's entitled to strip fitter for the outing; shoulders a 3lb penalty for the French win.",
          "medical": [],
          "quotes": [
            {
              "date": "2024-10-04",
              "horse": "Doha",
              "horse_id": "5293185",
              "race": "Prix Dahlia - Fonds Europeen de l'Elevage (Listed Race) (4yo+ Fillies & Mares) (Turf)",
              "race_id": "878446",
              "course": "Saint-Cloud",
              "course_id": "crs_5694",
              "distance_f": "10",
              "distance_y": "2200",
              "quote": "This is massive and a huge pleasure for all the team, especially with Sheikh Joaan here to see her win. Treve hasn't had a whole load of luck as a broodmare up until Doha, but it's so difficult when you have a brilliant racemare and they get so few chances to breed a really good one. We're very lucky and hopefully this is just the start. She ran with credit in the Nassau Stakes and Ralph has done a great job. We'll discuss with him and Sheikh Joaan to see if she runs again this season, and it's not impossible she'll stay in training at five as she's still improving - Rupert Pritchard Gordon, Al Shaqab's representative in France."
            },
            {
              "date": "2024-06-19",
              "horse": "Doha",
              "horse_id": "5293185",
              "race": "Kensington Palace Stakes (Fillies' Handicap)",
              "race_id": "869185",
              "course": "Ascot",
              "course_id": "crs_52",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "Obviously Royal Ascot is a big deal for Sheikh Joaan and Al Shaqab. It just occurred to me that dropping Doha back to a mile in a race like this, where they go a good gallop, might just play to her strengths. Obviously she's bred to get a mile and a half well, and more, so it was a roll of the dice but it was worth doing and it worked out - Ralph Beckett, trainer."
            },
            {
              "date": "2023-10-16",
              "horse": "Doha",
              "horse_id": "5293185",
              "race": "At The Races App Expert Tips Maiden Stakes (GBB Race)",
              "race_id": "849570",
              "course": "Windsor",
              "course_id": "crs_2418",
              "distance_f": "8",
              "distance_y": "1791",
              "quote": "I think that's winning as your pedigree suggests you should do. Doha is exceptionally well-bred and it's important that she wins her maiden and hopefully we can go on to better things. She's not short of speed. She's quite a racy filly - she likes to get on with it - so coming back to a mile, having not looked like we saw out the mile and a quarter last time, was the obvious step. She will stay further in time, but she's probably a bit quicker than we would expect her to be. It's stepping stones towards black type, if you're not winning your maidens it's hard to take that leap. She's done that impressively and Ralph will plan where she goes next - Hector Crouch, speaking to Sky Sports Racing."
            }
          ],
          "stable_tour": [
            {
              "horse": "Doha",
              "horse_id": "5293185",
              "quote": "She's in the Middleton at York, which is a possibility. She doesn't come to hand very quickly and there are plenty of options for her, the Pretty Polly and so on. I'd like to have another crack at a Group 1 race at some point. She's training well and is a tough sort who loves her work. 28-04-25"
            }
          ],
