          "spotlight": "Pulled up in Saudi Arabia in February (heart issue) and soundly beaten on sole run since in handicap at Haydock last month; however, he may have needed that latest run and is 2lb lower than when winning a handicap at Killarney last August; followed up in 1m6f Group 3 in Germany; not ruled out.",
