              "quote": "Caballo De Mar has run a great race. Callum [Shepherd] said he was riding almost with one rein most the way round as he didn't really love the track, but ran a monster race. He's got his whole future ahead of him in this sphere and he'll go to Royal Ascot now. We'll take a view where as the winner's a very good horse coming off the jumps and was well-handicapped - George Scott, trainer."
