          "comment": "Third of 16 in this 12 months ago (good to firm) when 1lb lower; each-way claims once more",
          "spotlight": "No threat on his last two Flat starts last August/September but was third of 16 in this 12 months ago (good to firm) when 1lb lower; ran well at the Cheltenham Festival in March; holds each-way claims once more.",
          "medical": [],
          "quotes": [
            {
              "date": "2023-10-27",
              "horse": "My Mate Mozzie",
              "horse_id": "3316998",
              "race": "squareintheair.com Novices' Chase (GBB Race)",
              "race_id": "850707",
              "course": "Cheltenham",
              "course_id": "crs_286",
              "distance_f": "16",
              "distance_y": "3499",
              "quote": "That was good. I know it looked like My Mate Mozzie won on the bridle but about five times he's traded at very short odds on but got beat so it's hard to know how much was left. I'm happy with the result, he jumped ok and was still a little bit novicey. You'd love to think he'd go down the two-mile novice route, he's not going to be suitable for soft, winter ground - Gavin Cromwell, trainer."
            },
            {
              "date": "2021-11-07",
              "horse": "My Mate Mozzie",
              "horse_id": "3316998",
              "race": "For Auction Novice Hurdle (Grade 3)",
              "race_id": "797702",
              "course": "Navan",
              "course_id": "crs_5018",
              "distance_f": "16",
              "distance_y": "3520",
              "quote": "The only negative I'd have about My Mate Mozzie is that he was jumping right most of the way. I think a right-handed track would suit him better but he's a lovely horse, very straightforward and he travels and jumps. I gave him a squeeze after the second-last and he felt like he sprinted away from them. He's an exciting horse going forward. I gave him a squeeze after the second last but I hadn't fully gone for him and I was very happy I was always going to win - Mark Walsh, jockey"
            },
            {
              "date": "2021-10-13",
              "horse": "My Mate Mozzie",
              "horse_id": "3316998",
              "race": "BetVictor Proud To Support Irish Racing Maiden Hurdle",
              "race_id": "795459",
              "course": "Punchestown",
              "course_id": "crs_5070",
              "distance_f": "16",
              "distance_y": "3520",
              "quote": "My Mate Mozzie did what I hoped he'd do. He's a lovely horse and he loves a bit of nice ground. I don't know how he'd get on on winter heavy but he looks a nice festival horse. I wouldn't like to run him on heavy. We could go for the nice ground at Leopardstown and maybe on to the spring. He's a very straightforward horse and has been good since day one. The good ones are easy to train - Gavin Cromwell, trainer."
            },
            {
              "date": "2021-04-30",
              "horse": "My Mate Mozzie",
              "horse_id": "3316998",
              "race": "Avison Young INH Flat Race",
              "race_id": "783433",
              "course": "Punchestown",
              "course_id": "crs_5070",
              "distance_f": "18",
              "distance_y": "3960",
              "quote": "My Mate Mozzie has worked out great so far. He has loads of gears and he jumps really well. It's a nice way to finish the season and hopefully he has a bright future - Gavin Cromwell, trainer."
            }
          ],
