              "course": "Beverley",
              "course_id": "crs_156",
              "distance_f": "10",
              "distance_y": "2187",
              "quote": "We travelled really well around there, but didn't go as quickly as I thought they would do. It turned into a bit of a sprint, which we didn't really want, but I got Kitsune Power rolling 3f down. I'd say he'd easily get 1m4f in time. He was knocking on the door previously - Kevin Stott, jockey."
