          "stable_tour": [
            {
              "horse": "Kitsune Power",
              "horse_id": "3735132",
              "quote": "He's one we bought at the Newmarket sale and he's been training well. He's come down in the weights and looks reasonably handicapped, although he couldn't go on the heavy ground at Ripon last week. We think his trip will be a mile and a quarter. 23-04-24"
            },
            {
              "horse": "Kitsune Power",
              "horse_id": "3735132",
              "quote": "He has progressed with each run this year and after two wins and as many seconds he is now on an 18lb higher mark than he started. Last time out at Goodwood he was a little unlucky, getting stopped at a crucial time, yet still finished a running-on second of 16 over 1m1f. He has a couple of options later this month, and he can add to the brace he won earlier in the year. 17-08-22"
            }
          ],
