          "comment": "Unbeaten over C&D and close second at Leicester recently; has plenty in her favour",
          "spotlight": "Won five times last season at about 1m4f (various ground), with three of them here; flopped on first two runs this term but returned to form with close second at Leicester (1m4f, good to firm) a fortnight ago; unbeaten over C&D and has plenty in her favour.",
