          "comment": "Soundly beaten on last month's stable debut; others have much less to prove",
          "spotlight": "Won off a higher chase mark for Dan Skelton last summer but, following a ten-month break, was soundly beaten over hurdles for new stable in May; others in the line-up have much less to prove.",
