          "comment": "Dual chase winner in Ireland last spring; makes stable debut after seven-month absence",
          "spotlight": "Dual 2m6f chase winner in Ireland last spring (good/good to firm); off since below-par hurdle run in November, though, and it's probably wise to wait for some encouraging signals from the betting before this stable debut.",
