              "race": "REA Dooley Group Handicap Chase",
              "race_id": "868755",
              "course": "Limerick",
              "course_id": "crs_4888",
              "distance_f": "22.5",
              "distance_y": "5000",
              "quote": "Kilmurry JJ did very well to win it although it would have been a travesty if he had lost it. We'll trick away with him and he still has a nice mark over hurdles so we'll make use of that later on - Terence O'Brien, trainer."
