              "quote": "She looked nice from the day she set foot in the stable and after some encouraging pieces of work I thought she'd win first time out. Unfortunately, I chose Catterick to start her off and the track didn't suit. She put that fourth place over 5f to good use, however, as she won at Carlisle next time having been stepped up to 6f. The handicapper has given her a mark after just two runs, but we can't use it until after a third run, which could change again. We have to find her somewhere with a penalty to carry next time and it's likely to be for fillies only. I like her a lot and she may run at Carlisle on Friday. She should make a lovely three-year-old. 30-08-23"
